(1091, 'nimble_api_news_data', 'a:4:{i:0;a:4:{s:5:\"title\";s:43:\"Nimble Builder slider now loads faster 🚀\";s:7:\"excerpt\";s:357:\"Dear Nimble Builder users, The latest release ( v1.10.4 ) introduces a new option allowing users to lazy load images of your carousels, which greatly improves page load performances 🚀. Nimble Builder has been successfully tested with the latest WordPress, version 5.3. Changelog : fixed : columns that have custom margins inside a section with [&hellip;]\";s:7:\"created\";s:19:\"2019-12-20 11:55:29\";s:3:\"url\";s:66:\"https://presscustomizr.com/nimble-builder-slider-now-loads-faster/\";}i:1;a:4:{s:5:\"title\";s:74:\"Nimble Builder : improvements of the custom breakpoint options 📱🖥️\";s:7:\"excerpt\";s:368:\"Dear Nimble Builder users, The latest release ( v1.10.3 ) introduces a new option allowing users to apply the custom breakpoint not only to responsive columns but also to all by-device customizations. Nimble Builder has been successfully tested with the latest WordPress, version 5.3. Changelog : fixed : [breakpoint] column reverse media query rules should [&hellip;]\";s:7:\"created\";s:19:\"2019-12-19 11:42:03\";s:3:\"url\";s:88:\"https://presscustomizr.com/nimble-builder-improvements-of-the-custom-breakpoint-options/\";}i:2;a:4:{s:5:\"title\";s:104:\"Nimble Builder now supports video 📽️▶️ background for sections : self-hosted, Youtube or Vimeo.\";s:7:\"excerpt\";s:358:\"Dear Nimble Builder users, Since version 1.9.11, Nimble Builder now supports video background for sections and columns. You can use self-hosted video like mp4 format from your media library, Youtube and Vimeo videos. The feature is documented in a new documentation article : How to create a video background with Nimble Builder WordPress plugin ? [&hellip;]\";s:7:\"created\";s:19:\"2019-11-27 15:29:49\";s:3:\"url\";s:114:\"https://presscustomizr.com/nimble-builder-now-supports-video-background-for-sections-self-hosted-youtube-or-vimeo/\";}i:3;a:4:{s:5:\"title\";s:83:\"🎉 The Grid module in Nimble Builder introduces elegant optional pagination links\";s:7:\"excerpt\";s:341:\"Dear Nimble Builder users, We&#8217;ve added pagination links to the Grid module. This can be very useful if you need want to display only your newest posts but still allow your visitors to navigate your older publications. Pagination links are disabled by default, they can be displayed by checking the new checkbox option in the [&hellip;]\";s:7:\"created\";s:19:\"2019-10-24 18:58:09\";s:3:\"url\";s:113:\"https://presscustomizr.com/%f0%9f%8e%89-the-grid-module-in-nimble-builder-now-includes-optional-pagination-links/\";}}', 'no'),
