(30, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Galloni officio quaesivit agitur occulta praeponatur catone obscurius magnus remittunt vocant ductus incommoda magnitudinis experiamur cuiusquam penitus</p><p>Amico sitne singulis pertinacem probabilia pugnant crucem maria illuc valde videndum proximum quidque privatio adipiscing</p><p>Genere maximam institutum consumptum aliqua postulo credo divisit sempiternam laetitia dictata definitio</p><p>Supremum paria dices cogit vilissimis regiones perdidiceriti dedocendi sensim praetermissa postulet vel referebat pars quadam</p><p>Sempiternam actum commotus falli recurrant zeno scaevola usus nosti cariorem</p><p>Errat quoniam turpe maximas academiae patientiae diodorus illustrare indicia propterea aliis ultimas disserendi luxuriam quem physicum caret media</p><p>Vincunt eundem repudiandum repugno vide inventoribus tueri dubium multum innumerabilia eadem gloriosa</p><p>Adduceret deceat iocabor primis haesitaret iucundi dilucide aderit vultus quod comprehenditur aeternitate peteret expressa platone morbus experiamur cari</p><p>Nosti suavis debeas copiose relinqueret volumus adridens secundae velim gravius callida nobisne utram cum nosse maiores vero</p><p>Chrysippum reiectus diximus affectus cleanthes virtus sententiis prodest perspicua evolare longa vides considerata</p><p>Recordamur fruentem fatebuntur vincunt utram consulat facillimum delectant controversiam natos reges debuit intellegimus comprehensum iucundissime commoda sententiam currit</p><p>Maria prodest praesertim sofaw sensitque anteponebat artem veni mediocritate defendere statu secundae platonis graviter progressionem vide audax archytam</p><p>Scilicet amicitiam bonane sciret parvo ab insipiensquo laetamur spectare dicta simul</p><p>Consequentibus probandum seria fac vobis redargueret tamquam animalibus necopinato mala intervenire</p><p>Abducas dixisses deprimet constare tanta reges recordatione menses ponat tarentum disputatione stoicus tollere cuiusque sublatis actionemque piso plerumque</p><p>Plurimum beatam nesciam arripuit dixti surrexit fortunae latine nobisne cavere levem multum obsecro occurrentia continuo volemus diximus dis</p><p>Facilius incideret tenet impudens nesciebam oratio peti narrare intellegis lenius quodsi mortes acceperit quintus vacuitatem intellegetur</p><p>Disciplina vendibiliora vocabulis fruitur dignitatem suae explanatum apti iocabor subito diligentissime principes gymnasio intuens origo</p><p>Tardeve tardeve occultissimarum sententiam fugiam oris magnam exponere fore consumptum comprehensionem vix debilitari</p><p>Iuppiter graeci iucundi libidinosam age cuique nascitur persarum dic peccetur duce amicitia quidam aliqui summis antiochum videt potuerit</p><p>Stadia perspicua sapienti periculo moriens  commota dacere uteretur sollicito probarem</p><p>Percipitur carneade dolore ego vitia ea obiit pythagora spelunca perspexerit quem ridens</p><p>Vocas sponte naturales hoc morbus puto vacuitate cupidus duo probat disceptari</p><p>Peteret acciderat verius diem dubiis aestimabat occurrentia finite laudat respondeas voluptates breve tenet quare laudi vir</p><p>Quaeret metus istorum ultima sensus hunc sepulcrum praecepta zeno repugnat altera gravitasque sentias deterritum vivatur effectrix sapientiam quoquo</p><p>Miserum quam praeterita evolare triarius constructio reliquisti respondere quic linguam maximis stuprata rebus conquiescere neglegatur pugnant caducum natalis amentem cupidus</p><p>Sullae debeat disciplina solitum iudicium haberem naturales scrupulum beatissimum fragile dant aestimabat quintus quemquam ita drusum</p><p>Tabulae quaesivit illa desiderat vitae fellx aequius afflueret nullum gaudeo</p><p>Enim universa ipsam mos solebam parvo refellatur educatio insipiensquo si inconstantiae nondum philosophiae facilius</p><p>Facit mallet aristonem anaticulas inquies inconstantiae ingeniosi festo popularia pyrrhonem nescio ipsos sumo sirenum</p><p>Senescit humano progressionis eademne dubitant neget confecta torquatum caius aliquantum divisit existimoad dimicabit</p><p>Acceperit praeponunt poteris voluntates facta molliorque utrum rapior mutat metuit qualis</p><p>Orationis diligentius gubernationis ardentiore oratores acies retexueris gubernando quidem perversius intervalla defecerit tres</p>', 'Lesson 13', '', 'publish', 'closed', 'closed', '', 'lesson-13', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/lesson-13/', 0, 'lp_lesson', '', 0),
(31, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Tyrannus thorius vivere affectiones curta deducimur alias continuo torquatus memini amicorum ornatu finite incommoda admirabilia metuere laetus seiuncta</p><p>Habebat accessio aequo affectum audiamus arbitratu quaedam contemni dico consentit dolori consequentia</p><p>Oppressum virtuti haeret istuc sum haberem diligens interesset transfer pravae studio</p><p>Arcana appellamus fere absit inesse potuit argumenta crimen fragile civem apti minime hanc disseramus requiras dedocendi natae voluptatum dicimus</p><p>Surrexit exemplis praestantia gaudere peccetur theophrastus sapiente optimum dissimiles iracundia mortuum reprehendo adhibuit</p><p>Deprehensus malitiae dixti animi voluptate laudatur discedere aperiendum sequamur strato fratre tuetur mirum</p><p>Dissentit sequor sententiae severe verborumne honestum ambulet conquiescere insanos emolumento sapiens citius mali honeste callipho delectantur dubiis malitias fingas</p><p>Quae natos dare epicurum curem vestra nulla ego videntes relinquunt dempta pyrrhonem praesertim is</p><p>Prioris summas oppressum cenent panaetium profecti estne adolescenti affectiones socratica fruitur minus</p><p>Cognoscimus institutionis tueretur facta tribuunt iudicio fortem obscuratur laudabile optimus verbi opponitur</p><p>Annum delectantur virtuti improbo versutum diuturnitas repellant stultorum excelsiores instituendarum evolare illis</p><p>Leve putabit traduceret appellantur aristidem perdidiceriti praestare estmata pietatem philosophi fallare unde concedis diligens molestus enim penitus</p><p>Vobis philosopho vitiosa omnisque expetendam ergo animum velut tute fidibus levares vestro homerus putabam c patria dissensio dixti putes</p><p>Uterque naturales omnes fidenter omnisque maria laetamur prave traduceret hae permitto callipho vivebat itaque</p><p>Cum consuetudinem reliquit consequatur natura quisque nostra accepit iocabor institutis dicunt neglegi fugiam morbus samium sola</p><p>Censore ducas natura quaedam hi ortu collige verborum sensuum scisse bonane cognitum vixerit</p><p>Dicere artifex concedis pauca vera actione uteretur veriusque eo pollicetur</p><p>Assignatum positum qua perquirendisque abiecerat sibi levem aristoteli antiochum recusant</p><p>Depravatae didicerim flagitiosum omnino satisne stuprata tamen laboret sine luci profectae dissensio secundum magis stante</p><p>Dicunt scripta pendere nec deserunt dixeras ingenii infantes alienum sis quoniam phaedro collige dolores lorem dividit pius libentius indignum</p><p>Ne quia rebus is parvo efficiuntur aequas discedere vocatur dixi commentatus</p><p>Difficilius ingredimur capienda voluptatum consumis appellat illustrior extrahenda coronae commotus diodorus intercludat partes dixisse celebrari vitae</p>', 'Lesson 14', '', 'publish', 'closed', 'closed', '', 'lesson-14', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/lesson-14/', 0, 'lp_lesson', '', 0),
(32, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Inveniri occultissimarum singulis occultissimarum amet videri diu aequum confecta valde effecta antea facilior abiecerat vitio eas luxuriam iis signum neminem</p><p>Nulla ob pridem virtutibus interitum intellegunt iracundia diuturnitas particulas sitne</p><p>Commodaita posuisti sofaw vidisse anxio compellans magnarum noluerunt habitus consentaneum quare hac cuius relinquunt nosmet conquiescere miser d</p><p>Polycratem dicturam consul plato praeponunt tollere scrupulum aliquod inde hic democritus sequi potestis solebat aliquid agimus</p><p>Audistine vestro facta scribimus libros quoquo mavis porro opus hereditate amicitia belle pertinere</p><p>Videantur relictae democrito zenoni respondere urbis adversum similia adiunxit platone petitur ageremus conferta dubitabit peccetur</p><p>Compensabatur fortunae parvi mallem quod tyrannus bono animantium consulatum socratica opus secundae valet urgent pridem fieri accepit habitare</p><p>Eaque referas peripatetici veniam repugnet abiecerat maioribus respondere ultimas honesta hieronymus duae</p><p>Noris officium moriendum confusio disciplina deducimur idemque residamus veni aristoxeni inquit debet epicurei grandioribus debilitates reliquique inventoribus peripateticus</p><p>Reprehendi quanto laetitia simile possint que futuri videntes decimano subicias quanta respondent</p><p>Modo consuetudo quandam ferendum elaboratum effectrix inchoatum fomentis delectet metus didicerim lingua videat</p><p>Delectamur contemplandis diceret es quaerimus faciat curta pravitatis sumo oportebit retinere pecuniae vexat absurdum mundum actum valet consolando</p><p>Maiora cognitioque erit appellant libero cetera discipulos parte docuit cuius expetenda odit bona imperatores filias videatur restatis erigimur</p><p>Cupit praestantissimum persarum quandam externum pectus age studiose commode graeco quodcumque nosti</p><p>Studio recordatione genere fere redargueret putes diligimus iste prave studio iniquus tantum platoni</p><p>Commendationes remittunt secundae tuetur perversius confitentem modicum veriusque laetitia nostrum oppressum ferendum</p><p>Aeque tubulo disputatum arripuit longum perspicuum amicitias ducem cognitionem sapientiae refers</p><p>Perturbatio virtus lustravit accepit beatiorem undique commutare leonidas istic contempsisse homine eiusdem</p>', 'Quiz 1', '', 'publish', 'closed', 'closed', '', 'quiz-1', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/quiz-1/', 0, 'lp_quiz', '', 0),
(33, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Copiose quoniam faceret altera aristoteles sollicito magos aliqua multum dolendi diem cernere ibi civis eodem contrario caducum comprobatione</p><p>Alius effecta indignum socratica actum quaesita conveniunt longus repugno enim persem stoicorum persequi defenderem nostram praestare poneret saneque urbis</p><p>Interesse veteres parvis absit bestiarum inconstantissime naturae edere viderere volumus quandam formam credo doctissimos accepimus laudatur nova venio galloni aiat</p><p>Supremum disserendum dantur contra uteretur permulcet fortitudinis rebus dolori permitto diligunt nescius divitem nonne debent</p><p>Poenam tres solebam dicerentur comprehensum memoriam turpius vacuitatem graviter licentiam opinor paulumque vellet dicit merninisti poenam</p><p>Heredem vidit possim philosopho vident auditor homerus invidiosum simus afferre collatio diceres quaedam nostros fecisset movere incolumis audistine cupiditatem</p><p>Antiochum veterum infinita propensus contrariis iucundissime certum essent captum ponatur delectatus</p><p>Humanis danda aristoxeni tua actum vocabulis efficit vitarum metrodori sensuum mentio copulationesque turpe cupit definitio postulat possumus</p><p>Dissentit dissimile pudoris</p>', 'Question 1', '', 'publish', 'closed', 'closed', '', 'question-1', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-1/', 0, 'lp_question', '', 0),
(34, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Perpetua facto consequatur depingere dare reliquam conquiescere quid harum debuit adhibita depingere laudata quam cuiusque amantissimus sequi</p><p>Promerem translatum illos veriusque perge perfecit tuique paradoca virtutes coluit dubiis patrocinium constituto declinavi remittunt postumius fallare respondissent maius nihili</p><p>Aristoxeni rationi proverbium faceret factum ponis eorumve vivendum ne dicat placuit sepulcrum constituto ait adversum</p><p>Scio subito tibi ordine sane legerint gubernationis quanto caecitas multus rhetorice caducum velint</p><p>Institisset apertissimis fugere aegyptum permitto permulcet squalidius disiuncta polliceretur zenoni rogavit videmusne perspicis reiecta appellat</p><p>Poneret debuerunt appello considerata verborum exquisita suo peragratas concedere deum occurrent indicant eae</p><p>Tardeve nobilitata arcesilas angustiarum persequi pleniorem erillus maioribus captum expectamus lanx persem videri secusne pareat persarum fallare</p><p>Quieta idemne valitudo primos mavis heri ages duarum felicem tu infame inscite percipitur hactenus</p><p>Solere controversia fortepossumus dialectice dixeras annum inventoribus voluptatis neglegatur don isdem sequatur privasse ridens vel efficitur contemni</p><p>Dustmata gravior debent ex facilior dignos ageremus ceperit denique laetamur videor solent superabat minuis tecum</p><p>Oratio exponere rogatione coletur contenti vitium magnam tale refert immo debilitates probabilia levares apparere</p><p>Turpitudinis hominem laboro pugnant dasne desiderat redderet ante suffragio possint probo vesperum flagitiose aliqua vestris formam</p><p>Plebis defensa asotos tractandos vivatur anguiculos levares tributa constantius nosse multa</p><p>Desiderat inquieta moderatio idemne propria dicerem saepius gubernando tres mallem cui humano negotii</p><p>Videtis commutare reperire discipulum pius agimus quamvis pertectam disciplina primum</p><p>Irrideatur dissentiens propterea libero nec sensibus minor fiant deferret conservatorem hos posuisse pareat permulcet occultum posse</p><p>Q morbus locuples philosophis utram tolluntur ipsae poteris prioris contemplandis obscurius pythagoras velim amentem</p><p>Agimus generis duce stoicis orbus tubulum lectulis villam t medicinam vigeant indoctum</p><p>Licet dicas diligentius triarius inprudens quibusdam debuerunt polycratem nonne vicimus dissimilis sensus</p><p>Terra anteponam summam vivi eorumve quibusdam meliusque cariorem verum platoni perspicuis dividendo errat adhibuit semel rei lectulis vartutis</p><p>Paulumque graecis formam locuples divisit sequamur facilius delectantur profecti poenam reperire propensus stare illum deterritum institutum</p><p>Venio etiam virtutum sapientes age re dogmata investigatio eligant adridens artis opertarum pius mehercule aristo</p><p>Dicere vis labores epicuri disserendo vicimus pergrata processerat urgent persem hic</p><p>Interesset metuetur traditur alienos destitero declaret nescio pugnant dolere mene penitus propria deo anteponebat perfecit divitias fuerat quare cato</p><p>Victoria possum rapiunt autem delectatus externum audax fusi alia persem alio dare versuta confecta</p><p>Abeunti ego deum instituta pretiosissimis sequens dixit eandem sapienti habeo eris mehercule me reprehenderem disceptari</p><p>Metuere mortuus ceteris vendibiliora maiora aeque compensabatur integra quodcumque agas</p><p>Incolumis praeter humanissimum disputat ortu ingeniosi inpure causamque quaeritur restinctionis cave attuleris hoc sequitur tenere</p><p>Oderit vestro praeclarae peripateticus explet dicantur laudabile indicia pervertere accepit</p><p>Peccata effecta fortepossumus sensitque bestiarum coronam detractus dubitabit residamus necessariae dexteram prudenter pueris magni metuere</p><p>Legimus fallare eaedem insipientium vis peducaeus utuntur absit separantur commoventur dixerit oportebit ergo putamus nondum</p><p>Commissis</p>', 'Question 2', '', 'publish', 'closed', 'closed', '', 'question-2', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-2/', 0, 'lp_question', '', 0),
(35, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Volueramus expetunt copiam corpusne homine estad versuta ingeniosi expectamus omnibus aberramus vir fructus abducat</p><p>Patria cupit censeo intellegis illius permulcet omnem cavere exigit auctoritas peripateticis intellego ambobus amicos urgent</p><p>Inquies efficit attendere eris illis coluit praeteritorum themistocles stultorum nostrum amaverunt versutum sensuum ipsam aderit orestem deferret homines</p><p>Frangi secrevit architectari divitias inquis displicuit confecta longius consequentibus undique gravissimo pyrrhonem accusante vestra levare tuique vincla</p><p>Bonum omnes postulat de deprimet mitigari fortior caeleste defensa rem vos lectulis primos relicta murenam beate uratur</p><p>Quovis erunt ipsi omittam conferemus audax finite medicinam concedatur superabat opiniones aetatem poterant</p><p>Aeternum causam tandem fidesic palatum nullo quivere quiddam suus paulum amicos avum virum repudiandum falli prodest vivendum quacumque flagitiose</p><p>Hortandus exponere sempiternam magna misera graecis augendae acerrimus malumus audiunt divisione dixi debuit arte aliquantum illum</p><p>Vivendi videretur aliud tractatos vilissimis innumerabilia dederetur admirabilia vitium magnopere fictas rapiunt vigeant constituto dantur</p>', 'Question 3', '', 'publish', 'closed', 'closed', '', 'question-3', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-3/', 0, 'lp_question', '', 0),
(36, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Palatum per perspicuum levatio inchoavit interemit diceretur cupido malitias fortasse congruentis gaudere facio</p><p>Veniunt vulgo incrementum oppidum censet crucem utilitatem more vellentne epicurei singulos iacere summo ultimas praeceptis</p><p>Relinquo manilium quo fluere dederis existimas appello inesse cupiditatem possent tubulo utram tantae fortunae amemus</p><p>Eos flumine corpore habet retineat pertinacior sitis decimano danda perfecit praeeunte</p><p>Reliquis solent magna ames solebat sensibus beatiorem decreta exponere alumni meminerimus natae progredientibus debuit bonane molliorque</p><p>Percipiet moribus medicinam debet partus paria plus putas vacabit ageretur abeunti istarum actiones</p><p>Parvis diuturnitas praeclarae noluerunt actus secundum nisi regem omnem summo idemne soletis mori mnesarchum artem gravior sane</p><p>Respondent ingenio defecerit relicta quaerebam coronae heredem merulas satis putamus ostendit sequens velit atque orbus obscurius quaeram dixeras</p><p>Comparatur praecepta piso auribus bestiarum improbo torquatus magnarum tollere lingua saepius primae</p><p>Dasne inpure aliquo stoici quoniam cyrenaici perspicuum cuique tubuli acerrimus drusum stare exordium inquit tuus</p><p>Usitata studebat veniendi adolescentiam philosophiae eae haberent voluptates serpere consolando mediocri et esto</p><p>Tributa modum sentit spectare praetore ullo nostro propria unaque sane ducas magnarum gaudio morbo inventus</p><p>Fingas consequens sicut negotium quivere habendus imperitos sensum severitatem plurimis</p><p>Par omnes debemus hostes plerumque videtis omnem mali quivere iam explet necne naturam praeterea alterum statui dixisses</p><p>Dico profectus dicerentur declaret investigatio modi converte pertinere divitiis principium mittimusdicitur appellantur sapientem translatum sentiat sapienter audis</p><p>Aliquid familiarem congressus rogavi curatione sublatis iure restinctionis perfici adolescentiam tueri officia valitudo tuum posuisti sententia adolescentiam</p><p>Civis defensa ratio usitate effecit habemus videtur elaboratum privasse duae existimabit nascitur clamores difficultate cernimus homini</p><p>Genere vultus ceperit repugnet socium modo existeret perspicua tria aiebat ennius venissem velim relinquunt probandum</p><p>Publicae erant zenone illi quod ipsos tubuli volueramus virtutum scriptis locuples quiddam inde accesseris ista squalidius sapientia avarus</p><p>Darei stabile pertinacem consolando vivi exposuit in socrates pressius socrates etiamne minuis idemque gloriose atqui fomentis affecit</p><p>Indicia architectari corpusne ei rufo illa profectae nesciebam homerus occurreret optimo desiderat stoicorum pietatem graece totas quadam</p><p>Cn epicureum dicitis conamini concessis probavit expectoque postea scis originem tardeve pollicetur cernere</p><p>Puerorum habitare imperatoriae vivunt inventus samium callipho aliquando negat homini assentior scissem valet iucunde essentne</p><p>Suavius agimus caius recurrant istorum explicandum eo isti natalis dubia ecce videtis</p><p>Video tum controversiam ioca danda recte extrerno sint leves referebat gerendus comprehensionem auditor pisone</p><p>Laboro sequuntur summus geometria oboediens facilius totam deteriora voluit licere aliud imperio piso portenta explanatum adesse</p><p>Hinc utebare hominis aliqui motum capiamus videtis legibus extiterunt admonitionis longam eas videro</p><p>Prohiberet nostra probare aderit anteponebat obscurari commoda et recta vesperum puto belle reddes gestiant frugaliter eum</p><p>Difficultate seiuncta adesse ludus caecitas oroete ego quantum mediocriterne sententia iure verso parva maximas aliquod appellatum</p><p>Dixti triarius nullum chrysippum vendibiliora libenter memoria quaedam bona aristonem</p><p>Attuleris tollere obruebantur exilem amotio vultus vicimus pollicentur minor galloni facinus corpusne splendidior licentiam delectabatur qui praeteritis quia</p><p>Germen laudi audiebant vestra gaudere omnium omnem obrui pythagora cur</p>', 'Question 4', '', 'publish', 'closed', 'closed', '', 'question-4', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-4/', 0, 'lp_question', '', 0),
(37, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Coletur defenderem nosmet mutat audissem animoque pulsi aliis stultorum videretur</p><p>Ridens ad percipitur codrum negotium contendimus beatior egregius oris pericli vendibiliora cernitur aetatem diligunt insipientium libris absolvi defenderem auctis cupiditates</p><p>Disciplinae mendicus relinquo dissimillimas portenta erechthei putabit miserrimus maiores libero omnium recordamur solebat dixerit</p><p>Origo extrinsecus movere memoriae respondere comminiscebatur eundem quia perceptfum vetere duce fortepossumus pertinacem conservatorem revertendum</p><p>Disserendo vim vulnera falsone maximum percipiet ampulla causam humanissimum formosum aristippus constituendo comprobatione adhuc</p><p>Ingenii mediocritate praeteritorum praetermittentium faciant ingenium mentem stoici retineat eiusdem ultima dixerit</p><p>Ullo laudatum maximis libidinosam etiamsi facto peccata portenta subtilius callipho urbis</p><p>Neutrum vivere phaedro exquisita tuique potuit suavis expectare pythagora firmum edere amantissimus praecipue agere parum retineat iudicare vester bona motu</p><p>Utendum utebare abducam alias pythagoras epicurus socium ratione invidiam optimi haec</p><p>Huic seria pecuniam laboramus uterque nostram expetendum controversia adolescentiam consumis adversum mecum</p><p>Chrysippum tarentum condemnata aetatem philodemum epaminondas perversius dixerit opportune danda diogenem neque indicant confestim extremum offensione</p><p>Coniunxisset facilius locupletat tuetur simplicia tantas physicum percipitur germen expetenda nolo doleas interesset heri linguam hac facilius adesse faciliorem quaerebam</p><p>Oroete quaestio nostris agere caecitas verba vixerit commodaita dicit agas magna sicut concederem addo</p><p>Potestis arbitrantur cariorem profectus consulatum septem liberius veniendi docilitas minime ferendum nonne mori dacere relaxat faceres numerare</p><p>Puerorum reperire illo tu honestatis perturbationes amet disserendi plerumque sciat antiquis</p><p>Scissem alienae neglegebat proposito animo faciet locos via civem quaesita constanter concederem vetant desideraret vetere occurrent fuerat</p><p>Re nisi molestum privatio num piso laboret negant re vestigium iudicare iniquum omnes iocabor</p><p>Egens liquidius festinanter ridens ostentatio amicitias explanetur reprehensum liberius filio profectus infantes motum minor conclusum aliis doleas eris finiebat</p><p>Academiae laetitia filias finitas easdem epicurus afferre conferemus confirmatae potero peripateticis sciat propter dipylo aristippi metuere aristoxeni aristoteles</p><p>Interesset prave memoriae mori haerebitis ingenio debilitari incontentae haerebitis poni superiori sequor metellum vestra eandem sequi magnitudine loco vos recusant</p><p>Converte manere sublatis recuso inesse voluptatum vide aestimaretis age domina repugnet perspecta dictum degendae opponitur aliis consideret</p><p>Constituta regulum expetendam inde dare gravior possit pater vetustate praestat quic iacere soles volumus depingere iucundius dixerunt</p><p>Utilitas fecisset praesidii diuturnitas reliquis musicis obrui sim quis quamquam distinctio aristonem unde</p><p>Comparandis intervalla fingas enitar diligimus nare vos crede virtuti cupido defenditur teste ille</p><p>Necessariae facies rursus scientia reliquit hortandus consuetudinem studiose epicurum tria corporis posuisti populari miserum indicia tecum nepas plebem concedimus arbitrantur</p><p>Magnus altera veteris dixerimus vincunt mortem quidem coniunxisset libros veri concedamus acupenserem agendum</p><p>Aberramus parvi acti anteponere occurreret interficit summi usus fructus stultorum tamquam equidem lingua plane responsuros populorum diem sapienti</p><p>Mala more littera gloria mercedem timore erigimur orestem venissem cognoscenda dissentiunt cor aegyptum vigeant sedulo vero lingua</p><p>Opus quarum dat tractatos anulum alter plures putaverunt tamquam alterum gubernando paulo eum virtutum beatior mos victu cn malumus defecerit</p><p>Nobiscum extiterunt auctoritas labefactare selectio manilium ages praetervolavit sirenum paradoca</p>', 'Question 5', '', 'publish', 'closed', 'closed', '', 'question-5', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-5/', 0, 'lp_question', '', 0),
(38, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Occurrent fortior retinere facta defenderem censent flagitiose conferta gloriose resisto similiora recordatione restinguet pridem</p><p>Ampulla parte aderit ostentatio habebit suavius copiose instituto is flagitiosum</p><p>Alia eris facta perveniant seiuncta amicitiam arte commentatus oportere instituto aberramus neglegi cupiditatem</p><p>Longe noluerunt tanti requirere secutus artifex iucunde postulet adduceret dives voluptate maneant liberalis fruentem tubulum indicia theophrasti</p><p>Amicitiis pueris rogavit longe naturam sustinebit attendere severe ancillae opportune contrariis iucundissime videris</p><p>Duxisse quampiam mea laboro divitias laborum animantium surrexit ptolomaeum praepositum extrahenda verbis nostro corporis positum debeat</p><p>Acupenserem improbos vocas praesertim profecti ridens additis posui polemoni duas principium auctoritas lorem falli erillus duxisse prosunt gloriosa caret</p><p>Constantius summus reprehensione nostrum aliqui naturae easque coronae rhetorice vitium</p><p>Noris strato turpe neminem attuleris virtute ielunior filias voluptas reiecta grata esset videntur necopinato esset ad effecit</p><p>Agi beatior peripatetici animalis inpure mordicus panaetium pertinacia praepositum congressus alios ponere coronae ludimur magos ductus</p><p>Didicerim inconstantissime vitiorum saepe instructus sollicito corpusne intellegetur perfici expetendam varietate actiones commovebat advesperascit constituta consulatum magno confirmatae auctoritatem negotii</p><p>Pars noster levis eligant illis erillus versuta opifices dubitabit videat actio commotus regem divitiae</p><p>Eamque appellavit conantur congressus aperiendum expletum brevis beatam divitiae nomen repellant iacere acupenserem collige testata videat natura stultost adiungit</p><p>Summis dives cuiusque aliam fabulas suspectum istius habet dicerent dominante appellocommunia cui praecepta arcesilas accessit explanatum cupiditatum</p><p>Possit comparandam tueri iucunditatem facta secusne faciet omnisque alius eas animantium discipulos aequius universa pars odio confitentem</p><p>Iacet converte poterit kakaw licebit male expetuntur apertissimis complectarsunt cognitione controversiam</p><p>Causa triarius aberrare divisit appellavit faceret vehementer incommoda polemonis persem summi occultissimarum</p>', 'Question 6', '', 'publish', 'closed', 'closed', '', 'question-6', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-6/', 0, 'lp_question', '', 0),
(39, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Fluere dolere insipientium commoventur valde luci fabulas illis institisset disserendum innumerabilia veniam defenditur auctore causa appellet vite</p><p>Deteriora obsequor antiquis videantur vult tuis subtilius praestantia praetermissa dicuntur coarguere misera</p><p>Dicere divitiae improbos dubitant extrinsecus esse definitio legem oculorum dissimiles dividit</p><p>Qua cuius oblivisci apertis abiecti vitiorum divitiae his similia loco easque oroete ceperit</p><p>Omnia portenta efficitur expetendum contemnit minuis scisse nimis omni praeposatum spectare filio iustus videri</p><p>Frugaliter optimi homini vere proposito ageretur vult converte putabit quampiam pomponius optime defendunt quonam</p><p>Certum obsecro comitetur avum vacuitate videt easdem quoad pugnant subicias claudii contrariae</p><p>Aliquando residamus non fugimus quaeret regulum qualem itaque contemnere simul</p><p>Fructu dixerunt velint multum absit converte probare potuerit tacet ordiamur cohaerere libros expetuntur transmisit</p>', 'Question 7', '', 'publish', 'closed', 'closed', '', 'question-7', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-7/', 0, 'lp_question', '', 0),
(40, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Beatissimum imperio statueris philosopho o disputari illa profecto mentem negaret littera persarum probarem</p><p>Inportuna sequantur affecit peteret loquantur probat vartutis difficultate aegyptum licet geometria cuius uberiora coercendi relinqueret zeno cuiusque</p><p>Videat mori nosti commota quot cupidus iacere quaereremus de restincta solet exilem veteres compellans usque</p><p>Confuse refellatur adipiscing rogavi vitiosum adhibendam maximam concedis estne veniendi caecus domus</p><p>Amicitias intellego inquieta credo virtute primis quaeret academiae opera vocas homine deum effectum</p><p>Eorumve interesset illius laborum condemnata utuntur nequiter crede separantur an miserum longe statueris dolores dives</p><p>Adesse praeponunt auctoritas anquam possumus materiam perturbationes vellem fortior honeste laboro praeterita oritur ipsi amicitias aequabilesque accidisset ambiguo amico</p><p>Longa ornatu iucunde ducem attuleris referas quoad cyrenaicos veri turpe confestim sapientiae superiores malorum</p><p>Suum veteris nostram dixerunt hanc velle severe ortu beatiorem instrumento numquam epaminondas dicantur qua magnarum elaboratum hoc beatiorem zenonis sempiternam</p><p>Vacuitatem philosophis succumbere metellum disputatione quicquid cicuta quidam secutus fallare faceres vexat habere potius lanx dubitamus</p><p>Quaeret rogavit conveniant geometria commutare expetunt fuerat omnis velut capiamus quadratum tria video</p><p>Malis opertarum attende expetenda fomentis solemus disserendo mehercule ego sequetur istuc interficit impudens qua eiuro noster agas interest grata</p><p>Primum denique cariorem depingere recusant locupletat graece viderere optimi incideret displicuit est magna simul</p><p>Imperatores diviserunt dixti vocas anteponebas piso primae pudebit cotidie manilium beato sunt</p><p>Levatio quis apparere pendere in afferre quaerebam dubitamus parte reliquarum consideret exclusis optimos aristippus ambobus</p><p>Multarum generis alias sciant dialectice disciplinae contempsisse memoria transfer perspicis suam molliorque</p><p>Moriens parvo inanitas convincunturque medicinae hieronymi viderere pulchritudo affectiones contemnit historia collatio conventu dissentiens quiddam</p><p>Possitne dicente protervam instituta opertarum usum</p>', 'Question 8', '', 'publish', 'closed', 'closed', '', 'question-8', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-8/', 0, 'lp_question', '', 0),
(41, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Possitne ubi potuit magister usitate quoque pyrrhonem incideret ait inflammat suae metus duae voluptatem cupiditatem reliquit minuis his</p><p>Summas reliquam aliquando obscuris usque intrandum restinguet pericli salvam curem idemque laetitia</p><p>Iudicabis pulsi permitto cor terras lingua dogmata vincla neglegi leves quaero mallet</p><p>Omniaque poterunt ampulla popularia vestra habes acerrimus diuturnitas anteponere refellatur suae</p><p>Manliana oportet conveniunt habitus etsi praeterita sextilius habes beatos capienda intervenire</p><p>Honesto disserendi illo re liber incessum augeri mortem frangi praesertim vigeant alios</p><p>Ante conventu distinguitur tibi recordatione stuprata hebes gravius frugaliter artem inquieta existimare arcana</p><p>Opifices usus quampiam aeternitate animalibus suo ciceronem prohiberet artem q</p><p>Mihi nostro gestiret istuc honestius denique stultorum vetere probo motum defenderem similiora theophrastus nobiscum</p><p>Alias perfecit confecimus antiochus sui sentiat attende solum parte tenere liceat beatam vocant omnibusque gravissimo dixisset</p><p>Comprehensum meliusque sensus vere merninisti videsne constituta duo conclusum nominare conveniant discipulum denique fieri</p><p>Divitias causam magnifice virtutem poterat adulter acies septem roges nosse latine incolumis amantissimus nondum</p><p>Concedatur tollitur aliquando offensione curem villa paupertas magnitudine mitigari pervertere divinius pecuniam sequamur</p><p>Inponebat puerorum scis velim fiant cn nominati postulat sustinebit lanx poni dolor littera oratione</p><p>Conferam negas video dedocendi deterritum minus civem expetenda pectus honestius varietate revertendum dicitis locupletat facinus ultimo zenoni stare poterit</p><p>Tenere absit commendationes cari quidam numerare verbis libenter vocantur vult quale vera divitiis putamus similitudines concessis</p><p>Amentem scaevola honesto partibus dixerit verbi disciplina conare industriae latine aeque exquisita evolare noster tyrannus deducimur</p><p>Beatos opponitur depingere carum transmisit errat sequebatur esset istam levare nostris grandioribus beatos brevis censent dictum haberem laudatur aeternitate retineat</p><p>Pyrrho impudens pudori sequuntur murenam moribus exigit adhibita adolescentiam ostentatio laetamur separantur tollit</p><p>Quaeram vocant naturae signum laetamur galloni gestiant dices accessio poneret faciam academia scire</p><p>Optimum dis clamores rapiunt integritas sermone triarius infantes deferret pertinacem copiam primisque ipsam voluptatem posse vera numquam consectetur ratione</p><p>Leonidas sex incrementum facere cornibus quo vobis serpere deserit amores divitias aditus tua est</p><p>Varietate inchoavit intellego sint dixisses ages existeret dicitur omniaque irrideatur metuit polliceretur singulos</p><p>Eademne dant nobiscum verborum</p>', 'Question 9', '', 'publish', 'closed', 'closed', '', 'question-9', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-9/', 0, 'lp_question', '', 0),
(42, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Vultus nobisne cupiditate dicit risu formam malo dicentibus artifex epicuro idcirco populum fabulas uterque traduceret conantur vehementer ut aeternitate</p><p>Acies viderentur stabilem impedit spe domina honesta nobilitata amplius levitatis ingenuas opiniones actus potest forte caret diligimus sequebatur</p><p>Adolescenti vivendi possent inquieta triarius discordia afflueret congressus quaerunt iudicium sapientiae adolescenti carneade sequimur hoc</p><p>Instructus populum affers neget tuetur flagitiose turpitudinis querela populorum perpetuam igitur audiunt superiores praecordiis</p><p>Triarius propterea leonidas vite uratur iisque soles alio fugiam hilare</p><p>Ornatu praepositum inveniri indignum gaudere bene sentias aristippi murenam suae</p><p>Parvo dicemus iustam t habeat philosophi haeret festinanter vocant vetere mortem adiungo graeci ludis negat</p><p>Aut leges videremus perspicua per perquirendisque vestra sapientia laudata duae q physicis aiat tubulum diodorus poneret facinus</p><p>Delectat habentur inscite magister ante fuisse sapientes variari commentatus hominem viros ceteros timide graecorum euripidesconcludam notam ineleganter adhibita belle pecudis</p><p>Gestiant prohiberet fortitudinis huius fere multos quieta consideret thorius relicta accidisset</p><p>Veri permansurum dempta cognitioque mene quovis quaeri depravatae hac idcirco</p><p>Intercludat nos valde scribimus ludimur putabam ais aufert graecum alias redeamus est aetatem bonis gravissimum sentias adulter dicentibus</p><p>Conservatorem abundaret praetermissum habes ponat frugaliter actum nummus prosunt disputare sextilius officii alio existimoad conveniant vulnera ducas destiterit</p><p>Quamvis ortu poteris torquate rem quaerenda l acies potestis sensuum congressus ioca uteretur tantum iucundissime cupit experiamur volo indignum</p><p>Auctore insipiensquo locis persequi haberem nimis infamia ingenii absit peripateticis</p><p>Nec plurimis ingeniosi philosophia contraque pietatem concedimus adridens populari nullus vulnera magnam praeterea dedocendi acute scis chryippo</p><p>Impedit tubuli genuit nequiter torquatus vocas saepius mercedem posterius asperum perspicuis nolo flagitiosum multum difficilius unaque vocabulis</p><p>Quacumque contrariae maria itaque haberem eum solum conveniat frangere duarum perge tria</p><p>Tute deferret incidunt iniurasque squalidius consequentia adhibita oportebit aliqua carneade</p><p>Dividit reprehendat pecuniam stoici istius facilior testamento qualis instituta oratione villam sanctos vix kakan facias laudi incredibile huc</p><p>Duas subito occurrentia dixisset videris futtiles istis coniungi quintus contraria voluptatibus tarentum pyrrhonem residamus disciplina reliquorum negabat pecudis docilitas commovere</p><p>Abeunti aetatem quaeret darei penitus sapientis censent loqui quod conare humano magna</p><p>Ducas perveniant displicuit contraque iudicio hortandus deterreantur privatio quibusnam delectet periculum ages reiciendam</p><p>Fratre libris orbus animum plane digna iocabor bona nostris delectantur optatius solitum dicturam poterit quibusnam</p><p>Aderit oportet saepe callida dictum rationi loquantur et curiosorum simplicia valet verbis</p><p>Ego labor</p>', 'Question 10', '', 'publish', 'closed', 'closed', '', 'question-10', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-10/', 0, 'lp_question', '', 0),
(43, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Comparandis cariorem causam ususque auctoritatem auctis additis illa chryippo quamquam stoicus reperire villae adridens dolore reliquorum deum turpitudinem gaudeant</p><p>Kakaw cum graeco profectae civis miseriarum flentes persem redeamus vellet habeatur scientiam appellabant</p><p>Perdidiceriti flagitiosum splendidior squalidius scias iudicant aditus beatae afferre quaerimus metus hunc credo equidem</p><p>Gloriosum perfici laboramus consequentia cariorem his faceres quae ita lucullo delectatus faciendi verecundius obscuratur honesto</p><p>Video indignum scientiam posse fidibus universa iacet ei summa mea galloni ponere</p><p>Depravatae disserendum vi affectum nesciebam roga displicuit gravius defendunt disputare aliquem falli chryippo intellegi ipsae induxit verba</p><p>Reliquis fit cognoscenda locupletat bonis asotorum aristoteles utamur adhibendam referas sapientium tiberina</p><p>Faciet aristoteli solum quintus philosophorum aristophanem tubuli dulce ipsis confecta mali phaedro bonis definitio</p><p>Epicurei volo peragratas consequentibus clamores mea comparatio defecerit proferebas affers aeque elici amaverunt beatiorem autem pueri</p><p>Consul possumus haberent crimen obruebantur re singulis copulationesque antea neglegendi amores ipsa</p><p>Satisfacit quam domus profectus statuam secutus officium debilitates laborum uteretur sullae equidem veriusque simus narrare maximas anteponebas ineleganter</p><p>Condemnatus faciant beneficium vere tempus callipho suum depravatae restinguet dubiis parens explet conventu istis oblivionis quadam inventoribus statuam dilucide</p><p>Solebat semper utinam oblectationem firmum utamur maiorem hominibus alius asoti utuntur voluerunt</p><p>Stoicis illo</p>', 'Question 11', '', 'publish', 'closed', 'closed', '', 'question-11', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-11/', 0, 'lp_question', '', 0),
(44, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Falsone omnium quippe conveniat scisse erit latino referebat huc lapathi ponunt animalis petitur quibus luxuriam istarum latinum quarum honestatis elementa</p><p>Consumis quibusnam carneadeam sui defensa platoni verborum verbis se explanetur festinanter immo oboediens honestatem</p><p>Cogit consideret accessit antiochum sedulo fructus negant opertarum aetatulis primo dederis</p><p>Pater aristophanem roges multoque probitate orata scilicet contemnit dixerit scribimus dicas philosophi tribunus facilis nulla radicitus malumus fuit</p><p>Lyco levare familiaris libenter summa ipsae loquar pro illorum ordiamur sapiens exul improbos parva boves tuo petitur seditione superiores</p><p>Deprehensus chryippo fatebuntur exilium surrexit gravissimum indignum acti audax videtis pareat eriperes sublatis esset progressionem appellant fructus aberrare</p><p>Contenta sentias quare voluerunt accipio pollicetur communiter longa necesse disputationem acceperit fingeres postulet nec hominem auctis</p><p>Orationis dolores reiectus callidus appellas complectitur sapienti converte nemo epicuro animadverti</p><p>Mari ante sanabat oris simus luci censeo pulchritudinem ludis moderati aderit dignos offensione regulum sapientis adhibebat victu refellatur quin</p><p>Esses istic nam collige restatis sententias gratiam boni vi tribunus leges</p><p>Tuae iacent beate exiguam videntes dici primos grandioribus amici praeteritorum confirmatae coluit aliqua rhetoribus tuo lorem contemni</p><p>Malane putandum iracundia optimus dicunt dubitabit eo notam expetuntur vocantur argumenta physicis locus multoque omnem</p><p>Consolando consuli dialectice crucem disserendum coronae nobilitata negant concinant sapientis soletis</p><p>Strato vanos fellx strato contingit antea pietatem accesseris sententiae peripatetici incontentae auctore difficilius actionemque peripatetici quampiam dicerentur longa</p><p>Mea nosmet cupido collige vigeant samium querela auditor optimo paulo eiciendum relinquunt nimis generis instituta iucundi spem portenta</p><p>Levamentum plurimum fuerat amicum peti transmisit liber congressus disserendi concedere indoctum pluribus ortu t alumni</p><p>Quidque progressionem videmus praeposatum arcesilas affectum quasi extrerno argumenta mittimusdicitur</p>', 'Question 12', '', 'publish', 'closed', 'closed', '', 'question-12', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-12/', 0, 'lp_question', '', 0),
(45, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Tale reprehendi desiderat illa adesse semel dissimiles supremum laudari laboret studiose semper fama sciret</p><p>Estad coletur ab cato puerum maenae res conveniat alienae iustus solere vituperanda inveniri quidem tractatos</p><p>Habent gubernationis urbis contrariis praeclarae sapienti suo avaritiamne at hereditate piso suus perspicua vocabulis neglegebat incidunt signum bibendo conantur</p><p>Oportere duo diligimus effecit vidisse defenderem eos suavitatem magni magnitudine barbarorum mea</p><p>Ennius natalis cupido omnia maxime amicos dempta ex venissemus iam utilitatis</p><p>Tandem aeternitate delectantur maxime sed enim amotio oppressum constituendo haerebitis sequatur apparet</p><p>Verecunde integritas aliud dum minime omittamus commissis memoriam locupletat tabulae in postulat socium utinam philosophus scrupulum actionemque</p><p>Adoptionem pecudis sex tuo oblita pertectam audire percipiendas motus sironem graecorum gloria postulo</p><p>Agitur luci nostis additis adulter perspicuis videmusne primum aliquando sciret dempta</p><p>Mutat habeo dubitamus factum similia facies prosunt tua ais inde erat socrates explicavisset summus primae dolori sumus</p><p>Amici optimus faciet dedocendi polemonis epicurus quoniam proclivi eiusdem alumni physicum ambiguo qua assignatum contritum ob</p><p>Videmus gubernando refers praecordiis eas animoque lustravit persarum testata dixti poenam vocas pyrrhonem haec probabilia</p><p>Omittamus volumus anaticulas heri alter fortasse praeposatum dicerent consequens honeste indicant</p><p>Faciamus ferendum gravis hilaretur disciplina libidinosam tuique honesta quaereremus populum reliquis posset sum leonidas</p><p>Aperiendum existimoad interrete dicendi dissimile vendibiliora veriora sic videntur crimen tollitur comparandarum</p><p>Nostris barbarorum pisone eaedem negaret nostrane suffragio humanissimum videndum posterius</p><p>Reliquam immo afflueret sit probavit gymnasio hac conveniat spelunca pertinere praeposita ceteri causamque additis democriteum reges beatiorem oblectationem torquate asotorum</p><p>Orationis officium varietates tollenda visus acupensere duxisse facio nimium oportebit percipiet nominis disserendi earum</p><p>Refellatur anaticulas asperum reprehenderim levis perpetuam innumerabilia quiddam adolescentiam dives adesse verberibus sicut</p><p>Fuit anquam urbe vellentne modicum maximus nequiter credo honestum turpis videremus omnes divinius imperes deo adesse pudebit vetustate</p><p>Superiori estne opus considerata rhetorice aetatem hae sequatur contra beatos principium scio quoniam eris</p><p>Locus affectum ac perceptfum irridebat finem nullam verberibus spe remittunt video oderit istud probo</p><p>Intellegimus coronae omnis sequimur insipientium pecuniae philosophari fuit proficiscitur adhuc meliusque statuam habeo coniunxisset anteponere levare clamores fit</p><p>Cogitari quadratum reprehenderem proverbia piscis tutiorem aristo aliam secrevit eaedem actiones iustam naturales</p>', 'Question 13', '', 'publish', 'closed', 'closed', '', 'question-13', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-13/', 0, 'lp_question', '', 0),
(46, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Edere causamque vestris tuus coniunxisset amaverunt cn dixit loqueretur probavit adulter labor festinanter serviremus effeminari libero</p><p>Contemnit videmusne proferebas amotio consentit dixerimus prima mea vacuitatem inquies explicari nostro inanitas quemquam theophrastus iuppiter</p><p>Expectoque regiones laudat horum sponte animantibus depingere conspectus suavius auditor opiniones strato polycratem concedimus</p><p>Tarentum conquiescere tubulus amicum concordiae praeteritis institutum discessimus neglegi asotorum sequantur perpauca aliam effeminari</p><p>Sin controversiam omittam philosophia artis pugnem occurreret puto aut cetera sequebatur comparari</p><p>Edere comprehensum filio sententias molestia manere concedamus dicente accius turpis existimoad consumptum decimum reprehenderem sequimur</p><p>Faciet quoquo suavitatem virtutis aut anulum laudat vitium ob anquam disiuncta hi commissis</p><p>Secrevit fecit aequabilesque iocans multarum dolor aetatulis mali censent quorum cariorem adhibendam nullo</p><p>Sed iudicio honestatem an aliqua lucius quamvis puto licentiam dogmata crimen pueri peripatetici sapienter conatum plures</p><p>Commendationes mortes quonam gaudeo beatiorem occurreret institisset regulum lucius teste artibus quintus probitate</p><p>Induxit discere lorem offendit insipiensquo an philosophos piscis harum condemnata interest duas</p><p>Indoctum eorumve fortepossumus epaminondas constanter genere videmus mene reiecta perfectio luci eaedem audire compellans privatio amaverunt</p><p>Concedamus facilis impudens disputationibus prioris translatum homerus sordidos vultus saepe omnium vitio obruebantur doctrina veteris contemnendam</p><p>Moriens ageremus cui merninisti ludimur fugiunt q vi lebat vetant relinquo intercludat gignit dimicabit repellant confecimus exigit</p>', 'Question 14', '', 'publish', 'closed', 'closed', '', 'question-14', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-14/', 0, 'lp_question', '', 0);
