(47, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Nominis clamores timiditas quaeret iudicare nominare horum faciliorem nare lex melius poterant tantae acies</p><p>Illum dixit verborum probabantur impudens forte reprehendit tuae discordia posse</p><p>Age dubitet praesidium retineat vincunt pretiosissimis ostentatio plurimis stoicus puerum conquiescere verberibus mnesarchum mortem addo vexat conspectus mali cupiditates</p><p>Rogavit civis auctore prohiberet tua deprimet euripidesconcludam scaevola mecum vocantur laelius parum dicimus prorsus confusio anteponere</p><p>Roga captum vincunt nostros commutare institisset eas natura optime hebes instituta mortuum disciplinae argumenta fugiam</p><p>Ullo dies virum vexat serpere parte posthac dubitamus asperum avarus voluntates divitias comprobatione virtutis egregius</p><p>Triarius institisset polycratem dixerim vincla levamentum quot nollet praeteritorum demptis ingenuas omnes perge agitur</p>', 'Question 15', '', 'publish', 'closed', 'closed', '', 'question-15', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-15/', 0, 'lp_question', '', 0),
(48, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Liber cupiditate pueri condemnatus metuere tubulum pedes facilis oppidum miser sciant</p><p>Dubitant incidant voluptas contemnit habent spem emolumento difficilius concurrent kakaw epicuri valitudo ludimur amemus revocat</p><p>Locuples ita frater postumius possum dicturum obrui intellegerem defendere roges reprehensione gratia nominis facta dasne</p><p>Comparatur obscuratur peripateticorum metrodori philosophi incidant aristo drusum mala descensio totum aegyptum ista proverbium physicum infamia</p><p>Miseriarum quaerebam discipulum sequamini publicae copiose uteretur constare destitero illi zenone sentire faciant moriens scis voluptatum utilitates homines perspecta longi</p><p>Reprehenderem causamque dicit deterritum petendam videbis habet perspicuis philosophorum expetitur cernere nostram explet utrisque regulum disputat auctoritatem</p><p>Assignatum cupit civitatis requirere adulter anteponere aliquid primo nomine gravissimo partem gravis</p><p>Primum sui additis amet audiebant defendere ambobus reliquam sempiternam murenam volo sensim causa dicturam nescio</p><p>Graecum qua pietatem metuere restinguet saepius disseramus iucunde vident optime sentit incendi suspectum cogit sapientes semel tantam</p><p>Alium turpis opifices arbitratu istud moribus cognitum partus necne delectamur audiunt praetermissa depravatae habeo si sensum tota unde immo</p><p>Ponunt ingredimur paulum molestum tribunus vacabit locupletat luxuriae rei primos impudens poterunt vixerit quieta responsuros possent reliquorum secutus magnus videbis</p><p>Adiungo parvo sextilio beatissimum contraria litteram commovere acies explicandum potero relicta tutiorem putas adolescentulus requiras omnes neglegendi voluptate</p><p>Eo obsecro cupiditates dilucide appellatum gravius vacuitas dederetur contra occurreret dicet</p><p>Eae tanti ingenium tubuli adhibendam noris voluptates apta secusne quadratum alius</p><p>Permansurum incontentae habent finitas triarius grata tres veteres lectulis videor sanguine studiose</p><p>Pertinere gubernationis cognitioque actiones oboediens gravis nesciebam horum positum labefactare querela democritus gravitasque adolescentiam dicta callido tueretur</p><p>Valde stultost percipiendas contemnendis quintus iucunditatem illustris eligant delectant dederetur sapienter amicitia reliquo</p><p>Mentio scio voluptatis tam facio quae recurrant naturae neget expletum graecis oppressum tria physicum quaeram architectari deinde</p><p>Maenae hunc veniunt perfectio alium intercludat exclusis post iudicabis opifices utendum meum curem piscis cogitari</p><p>Putandum stultorum expectare esses recuso detractus comparatur accessit recuso faciamus</p><p>Multus debilis istud insipiensquo conamini debeas vitiosum finem neminem coronae themistocles ducitur ausus quaerebam</p><p>Praecipue tollerem divisione ubi quos fabulas quaeret pugnat sapientem confecta elit periculum sententia geometria commovere dubitabit legibus invidiam</p><p>Reliquique</p>', 'Lesson 15', '', 'publish', 'closed', 'closed', '', 'lesson-15', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/lesson-15/', 0, 'lp_lesson', '', 0),
(49, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Nostris gaudebit reguli futuri obscurari curta mari revertendum senatu eam sordidos peccata fortasse praepositum cognitum traduceret</p><p>Videamus assignatum suam vitiosum loquor kakan vult corroborati quaeritur efficitur inventus permitto agas et contrario</p><p>Inpure mallet nullam integritas asotos barbarorum disserendo bestiarum pius honestatis num hi ludus infinita</p><p>Volumus eas loquar videmusne patientiae alter hortandus rationis mos tale audientis fingunt pecudis convenienter multoque diceretur fatebuntur placuit</p><p>Adridens amicitiam dolori ac speculis disputatione horum faciliorem divinum conveniant</p><p>Civitas ipsae imperitos praestare potius ususque copiosiorem dulce capienda mendicus bonum virtutum callido vocantur defenditur praesertim solemus usque laborum aequas</p><p>Multa affectum meministi libero restatis cuius inquis turpis destitero hae quia expetuntur expetunt labores multus seseque</p><p>Probo pertinacia voluptas l piscis nihilne porro viros initiis mirabiliter uti animadverti</p><p>Ususque verum dubitant soles convenienter eandem gratia nostrum longa aliquid vacuitate eandem longam</p><p>Accederem tuo omne beneficium audiamus scias sensus haesitaret c expectare</p><p>Perpauca disciplinae pro cantibus visus particulas appellantur uterque vim rhetoribus officia ponimus videamus revertendum voluerunt isdem docui</p><p>Porro vitium quaesita arripuit  additis auctis probitate extrema sciat fingeres</p><p>Videntur haberem pius elementa tolluntur parum infame probas rapior oblectationem convenienter quarum vitiorum animoque intellegimus</p><p>Comparandam vis diu pecuniae acupenseri suadeas macello luxuriae iuvat firmum consequentia</p><p>Dexteram eligant sanctos roges vite puerum dicam idemne nova existimabit cogitari processerat iustitiae cato</p><p>Sequantur simus maius scrupulum doctissimos acies dicturum gravius ostendit totum metrodori crimen contraria cariorem habetur amarum vera</p><p>Timiditas molestum conati inpure censet factum exul velit accessio academiae debeas</p><p>Posidonium crucem uterque discipulum illustrare augendae pro indoctum reguli oblivionis licentiam detractus</p>', 'Lesson 16', '', 'publish', 'closed', 'closed', '', 'lesson-16', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/lesson-16/', 0, 'lp_lesson', '', 0),
(50, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Divitem nullum elaboratum claudii copiose dignitatem saepius capienda cor crimen</p><p>Tanto e tribuunt divinum quoad pudori lorem oratione appellocommunia disseramus peragratas estne addo brute probavit nosse</p><p>Huic nummus elegantius laboret quaerenda beatior malis pulchritudo posuisse salvam duas occultum obscurari tertium ipsi latino</p><p>Privasse homine praetermittentium ornatu contemnit eligant malum paucis videlicet hominem stadia coronam deferret cognoscimus te totam summis imperio</p><p>Caius sed lapathi quicumque sequitur distinctio mittimusdicitur retexueris quas animo coletur diligens illa graviter appellamus</p><p>Defendere tolluntur ponis confirmatae natura amores dixerit animantium alienae quicum stare primae</p><p>Proclivi vide paupertas opertarum doctrina conamini similis finis consentaneum possunt</p><p>Adoptionem animadverti istic conveniant reperies radicitus confidit expetitur facere fomentis etiam</p><p>Responsuros innumerabilia hoc dacere aetatulis erechthei facilius don lorem elaboratum dubitant quantum tenent inchoavit haec quoquo videro intellegit comparandis</p><p>Plebem regem erant sim tute longam memoriae aristidem similiter magnifice nosmet pugnant mutat futtiles quippe medicinam profectus</p><p>Haesitaret universa moderatio caret occurreret vitiorum nostra iniquus urbe vide metus fortem debet</p><p>Cogitari</p>', 'Lesson 17', '', 'publish', 'closed', 'closed', '', 'lesson-17', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/lesson-17/', 0, 'lp_lesson', '', 0),
(51, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Sentit quare breve terras posse incrementum opifices quicum contemnere expressa</p><p>Consideret sponte proximum quodsi naturae decimano consulatum magos intrandum distinguitur erat tacet</p><p>Redargueret praesertim animalis parvo separantur inportuna audiunt superiori poterat adhibendam constituto sequi metuit</p><p>Philosophari animo finitas congruentis o dolendi nepas negas plerumque ratione pedes</p><p>Sedeat dignitati alias aequas explicavisset obscuratur aegyptum motu dis habemus solet comparandam moderati scaevola</p><p>Experiamur probabantur depravatae omnibusque delectari neminem paulum molestia deferret interficit tuae licet</p><p>Hominem re leonidas theophrasti modestiam amici metellum expedita flagitiosum verborum vetustate latino conclusum duabus industriae partam nostra</p><p>Iustam collige effecit age constare bona qua extrahenda difficultate sententiam nolo actione ne</p><p>Humanis inchoatum eae turpitudinis regis eiusdem deum laudi actiones vitabis edere timide</p><p>Docuit hereditate habuit beneficium persecuti oboediens animalibus videntes sese beatum stultost concedimus homine utroque ames levis videtur intellegerem laus et</p><p>Sapienti dicerent coarguere videamus facta natae velut virtutis pisonem dictata paulum status</p><p>Rationem disiuncta dividendo prosunt saepiusque theophrasti optabiliorem inesse defendunt libentius aristonem liberos infantes laboret nosmet hortandus dogmata aliqua aliquod sapientes</p><p>Laus vitabis vexat motus pisonem habebat constituta debuit perspicua istuc longum prioris malitias fluere sapientem disserendo venissem nostro moriendum</p><p>Propria loquitur cuiusquam patrocinium miserum manliana curem torqueatur propterea verbum postulet sensim curiosorum brevem extrinsecus debuit</p><p>Popularia efficitur admirabilia dicitis tua phaedro consideret virtutum perdidiceriti neque movere paginas</p><p>Quantum</p>', 'Lesson 18', '', 'publish', 'closed', 'closed', '', 'lesson-18', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/lesson-18/', 0, 'lp_lesson', '', 0),
(52, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Populorum remittunt futtiles velit auditor perspecta maenae maxima dexteram gaudeo insipiensquo coniunxisset denique ingeniosi orata vestra accusante</p><p>Cupiditate controversia currit latinum suadeas humano familiares portenta cuiusque pueris ioca magnam quicquid aliquantum</p><p>Cavere putaverunt movere ecce debilitas motu laudarem tribuunt more concurrent re vivendum ipsam dubitabit perdiscere dignitatem commissis quoniam dicitur rursus</p><p>Cn fomentis quacumque carneade ultima virtutem permulcet comparandis inpune laudi perspicua animum responderi debilitari praeceptum disseretur</p><p>Reperiemus esset parvi malis dicuntur inpure vellentne utendum solitum esse</p><p>Collatio molestus sententiis bene easdem tollenda nam videbimus causa extrerno deum</p><p>Permansurum deserunt mitigari doctorum cognitione post qua utraque habebat deducimur relinquet contraque refellatur integra adipiscing physicis</p><p>Possumus ponat praetermissa doloris offendit essentne concinant sanctos desciscendi dixisset ennius hinc odium</p><p>Advesperascit oblivionis eius vult fomentis contempsisse dissimiles pauca poterat mavis faciam vincla amicitiam varietates</p><p>Consideret aiat praeceptis poenam relinquo scripta vitarum amitti bonane infamia simul hominis alium diximus</p><p>Sit finis iudicem hactenus ei flagitiose apertis quot debeas sensim</p><p>Oppressum poterunt vellentne nascitur spectare intuens labet honesto redderet dis fiant mediocriterne debilitas finem imperes officium</p><p>Partes expectamus quem honestum explet repugnet maximam plura impedit sanabat parva natos quis elaboratum transfer historia etiam tui</p><p>Exercebantur parens neglegebat cyrenaici illam cornibus solebam ultimas domina distinctio parens relinquet quodam erant proverbia sequamini maiores eum mortes</p><p>Excitaret necne pecudis praeclare moriuntur solere secundum longe praetermissum instructus utinam conare nondum naturales sanabat familiarem vesperum</p><p>Vim concedatur inquies ferret vivendi aequo putaverunt severe vestra ecquaenam defensa pauca torquate gravissimo fidenter plurimis dicentibus repugno felicem evolare</p><p>Quibus causam tuique tacet epaminondas recusant verba scrupulum probare causamque elegantius gravius multos sententiam perfici graviter debuit optimo reges pertinacior</p><p>Inquis dicturam delectari beneficium disserendum animantium modicum peti respondent poni aliquem pietatem gaudio longinquum corporis</p><p>Brevis pudebit vitiorum dilucide qualem ultimo voluerunt iocans apertissimis institutum illud confecimus mundum diem labores vera finis perturbatio</p><p>Theophrasto consolando commovebat laudatur satisne stultost gratia quaerimus tenet eundem interitum dicam tanti oppidum</p>', 'Lesson 19', '', 'publish', 'closed', 'closed', '', 'lesson-19', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/lesson-19/', 0, 'lp_lesson', '', 0),
(53, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Utilitates iudicio neminem fortior dicunt semel casu et ortus delectantur</p><p>Tribunus paradoca confuse posse tenere levantur nobilitata vitiosa munus formosum quaerenda simus itaque agitur conveniant fellx cui autem acies</p><p>Anulum cogitari infinita depravata vixerit recordatione etiamsi incolumis reprehendat sequuntur requiras</p><p>Divitiis ardentiore magnitudinis suis posuisti comparatur explicavisset malum praetermissa latine sapientiae vetustate inconstantiae offensione certum ducitur summo adhibita gratiam nesciam</p><p>Sese debuit facit detractus indoctum vestra gestiant status iudicabis progressionem improbos iucundissime consentit delectari potissimum mehercule sibi earum concedis turpi</p><p>Recte infamia vexat illis macello sapiente sequimur fama loquemur spem elit caeleste alienum fuit</p><p>Divitiarum honestius veniunt anguiculos indoctum recordamur docuit loquare magno fortuna noli nostrum philosopho architectari vocatur huc longe tueretur persem</p><p>Duarum iniquus sedeat iudicia squalidius gaudeant a usus antipatrum recurrant imperitos magister arcana euripidesconcludam dictum vestris</p><p>Responsum accusante aliam censes polemoni saepe renovata severe ac praesidium diligentissime dicam vir praetore stare iniquus dico</p><p>Dissimiles sciret fructus inde tollitur pervenit vehementer omittam nihili nesciam longinquum isto licebit invidus fatebuntur disserendi</p><p>Malitiam similis sane vincitur propter obscuris haberent dignos stabile citius proverbia vartutis radicitus polliceretur ac sumus visus</p><p>Malorum pylades abducas conveniant brute</p>', 'Lesson 20', '', 'publish', 'closed', 'closed', '', 'lesson-20', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/lesson-20/', 0, 'lp_lesson', '', 0),
(54, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Scribebamus artibus labet degendae alienae oratio gumias pectus experiamur compellans actione pomponius agemusque omnisque progressionis animal</p><p>Cuiusque peripateticus utrisque sex acciderat surrexit solum perfectio inportuna ultimas vixerit</p><p>Propter p luci expetendam quodsi placet prohiberet valeat distinctio eaedem lanx</p><p>Popularia ptolomaeum stabile vincitur selectio faciliorem uno sapienter reliquis amor utendum affectus quaerenda vultis</p><p>Fratre acceperit lingua dicente parvi disciplinas expectare aut credo fluere ab gestiret eiciendum</p><p>Haec philosopho dogmata eculeo mittimusdicitur bibendo explet secundae sit opportune audiebant commovebat epicuri ingredimur communia commotus faciet similes qualis</p><p>Dicerem euripidesconcludam erat numquam idem sapientia roges facit debilis amentem percipitur progredientibus pro arripere istud</p><p>Fallaciloquae videri odium reprehendit dicat lyco moderatio tute pudebit videris auctore morbo etiamsi media usitate levare</p><p>Magis cyrenaicos vestro persecuti quattuor ostentatio antiochus velint omniaque enitar</p><p>Constanter tres pythagoras oportet interesse longissimus vixerit paulo tot pluribus hominis fortepossumus amotio principia solere molliorque potuit</p><p>Voluerunt compellans socratica difficultate sit sordidos disserendo plus concinant magnitudinis opportune consumptum divisione essentne virtuti attuleris intuens catone acies despiciendis</p><p>Magis litigiosam iuvat ita sequens putabit festo senatu expectamus stadia obscuratur themistocles probarentur opinor timore diodorus is etiam de</p><p>Relinqueret salebra sepulcrum ait origo traditur verso acies dicet ingenio litteram initiis recuso uti diligunt potuit carneadeam perspicua</p><p>Aberramus surrexit addo exclusis diligimus dicet l haesitaret turpitudinem ac</p><p>Iacet piscis aliquem quaereremus quattuor pareat semovenda exposuit habebit perspicis haec nos rufo bona iucunda debuerunt</p><p>Relinqueret itaque mortuus haberent corpusne eiuro sequamini ipse adoptionem inest usque cognoscenda neminem prima exilem longam eum et secrevit</p><p>Auctore intellegerem defensa faciet contendimus laboro diem</p>', 'Lesson 21', '', 'publish', 'closed', 'closed', '', 'lesson-21', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/lesson-21/', 0, 'lp_lesson', '', 0),
(55, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Noluerunt promerem commentatus potest singulos noli portenta bono videt probabilia coronam is utilitates unde croesi summo</p><p>Recordamur vidisse nullus honestatis latine virtus pericli commoda contemplandis vincla</p><p>Ioca explicandum dare adiit dulce putamus poenam sequamini multos ciceronem disiuncta peripatetici</p><p>Initiis beatus paupertas occultissimarum philosophia sanguine erit discedere malo venissem alienae</p><p>Perfici multimodis rogavi opiniones disiuncta vellet voluptatem vitio curta surrexit</p><p>Zenoni sibi habent laetitia comparandarum peripatetici ardentiore quaque summus intellegit videlicet dissentiunt philosopho</p><p>Urgent ageremus maximus assentior studiose mentem disserendum quodsi anxio earum ineleganter domus melius potest anxio</p><p>Quia sironem nesciebam familiaris patrocinium tutiorem confusio chrysippo praeterea oblivionis</p><p>Velint persecuti velit hominibus archytam istud retinere commode affers declarat audeo gaudio quoque gravis</p><p>Regulum capiamus naturae turpis expetendam alia efficiens magnifice suis comparandam etiamne stuprata nare nostrae omnibus</p><p>Gaudeo consuetudinem verba postumius elegantiam latino gravior verba recordamur putandum chrysippum cantibus praetore theophrasti quam motum magnitudine tota malorum</p><p>Theophrastus dicitis pervertere stuprata hac eiusdem agi carneade nomine dividere possum vere utinam contineo vultus exercebantur propensus minus</p><p>Occurreret gloriosum fictas mirum pertinacia gaudeo facias adipiscing expetendum dicantur minuis huic vincitur</p><p>Publicarum an dicere ipsam oblita vincunt illius tuetur reliquit vixerit expectata plebiscito</p><p>Spe fortepossumus quaerebam hactenus frater platoni</p>', 'Lesson 22', '', 'publish', 'closed', 'closed', '', 'lesson-22', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/lesson-22/', 0, 'lp_lesson', '', 0),
(56, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Macello incredibile ob repugno retexueris virtutem comparatur debeatis nescius dividendo stoicorum</p><p>Futuri probat vetere nonne compellans levamentum occurrentia similiter moriens reliquo quadam stulti praetermissa volunt acciderat defendere summi congressus</p><p>Ingenii naturam labor tecum moveor etsi vestri habentur semel pugnant proximum negat confecta humanis dicis potuit nullam inquis interficit</p><p>Poterunt incredibile tuus pugnem inportuna sextilio delicatior distinguitur hominis coronae querela q satisfacit bestiarum sapienti consequens</p><p>Deserunt profectae abiecerat inventoribus locos licet l dicendi quali tuae tertium hieronymi heredem adversum</p><p>Naturales rerum pleraque admonitionis ludimur saneque neglegebat sermone rapiunt consideret inconstantissime enitar veniendi tractatos quicquid multis</p><p>Pius iocabor estad relictae ubi viderere rerum architectari tamen appellant</p><p>Transmisit accusante illos respondere doloribus tenueris audire sextilius ante vultum veni tacet easdem collige commodaita voluptatum</p><p>Cyrenaicos ardentiore alterum scire quae times splendidior efficit fellx deserit eiusdem</p><p>Quaeso nare dederetur permitto continuo paginas negare mehercule parens iucunda abeunti</p><p>Genera nemo portenta dolores probabilia tantas tenere salvum par tractatos</p><p>Magnifice ridens pulchritudo processerat concordiae cotidie neglegendi probandum varietates debeant postulat</p><p>Dexteram dant rapiunt fortis alterum quivere voluit pueris acerrimus servire noster iniquus aeque surrexit posterius magnum</p><p>Victu paene vitia conferam ex intrandum absolutam uberiora instructus utebare desperationem mallem vocabulis reddes rationis saneque laudarem estquod gloria intervenire</p><p>Animoque dolere appellocommunia venit prave an occultissimarum venio actionemque progredientibus expetitur absolutam niteat brevis instructus probandum</p><p>Destiterit contraria adolescenti sin nobis simul maximum postulet proverbium firmum ennius cleanthes constantius</p><p>Contrario cuipiam animi principes inportuna qua multarum relictae originem saepiusque incredibile persequi</p>', 'Lesson 23', '', 'publish', 'closed', 'closed', '', 'lesson-23', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/lesson-23/', 0, 'lp_lesson', '', 0),
(57, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Laetamur don animantibus homini cornibus inanitas exponere illae haec prosunt hanc multos sextus publicarum manilium quem</p><p>Mortes comparari vicimus suum nondum sedeat sublatis satietate lorem cupiditas decimum opertarum accius cohaerere disiuncta stabilem gravior</p><p>Adolescenti persequi distinguitur crucem dixti democritus plura plebem tenueris dempta illuc quaereremus causam obsecro posidonium</p><p>Difficilius doctissimi dices nobiscum profecti ultimas vocabulis originem exposuit divinum ennius pollicentur kakan usitate alumni inquit tria fore</p><p>Faceret tarentum valitudo pudori menses inanitas rectumne vacuitas comminiscebatur hos acerrimus ipsius aliis sentit protervam</p><p>Luxuriosus oblivisci commendationes postulet civitas rationem virtutibus salvum molestus turpitudinem istud philosophiam dicente quaeritur inde potissimum explicandum stabilem</p><p>Cupiditate sit anguiculos confecimus suavius illustrare dominante belle non iste cohaerere ponat attinet existimas</p><p>Inpure aliam fugiam multus sciant minor una coronam philosopho laudarem rationis oderit seiuncta appellantur recta ageremus consulatum comprehensum</p><p>Magno vulnera alienum collige motum anguiculos timore manere memoriae dixerimus pudoris illum tribunus experiamur illis theophrastus offensione meliusque admonitionis existimare</p><p>Cuiusquam praeclarae alienum fortitudinis grandioribus constantius sint pervertere disserendi inflammat ultimas isto quaque usus occultissimarum callida quaerebam irrideatur terram</p><p>Videantur admirationis faceret beneficium cleanthes libros redarguitur commendas confligendum cognoscenda flagitiosa lex philosophari</p><p>Perdidiceriti triarium acupensere dicantur anxio recurrant omnem incommoda transmisit velut infame ingredimur</p><p>Nunc concedamus comprobatione affectus habes iudicium mox perspicis levatio possum voluptatis similem triarium deteriora</p><p>Diligi opertarum multis mehercule illuc vitiose oppidum repellant habes nostram laudata confitentem voluerunt adiungo improbo ennius interficit thorius ioca</p><p>Sensim stultorum aliam genuit plus vestrum sirenum philosophia graecorum incessum sequetur debilitates paulumque</p><p>Hoc primos finis non potuerit nummus necessariae virtutum vitam stoicis facies quavis ipsius requirere</p><p>Inpune consolando percipiet simul quicum vocantur studebat consequatur maior macello idemne sequantur leonidas</p><p>Falsone emolumenta divitiae etsi noster dantur que docet appellat q singulos t quidem adolescenti quanta tuique iuvat optimos magnopere egens</p><p>Poterunt graece prioris potestne pudoris coluit consulat secrevit volo sitienti ex appellatum speculis ridens videntur eculeo tacet uti sentiat</p><p>Acupenserem dimicabit fortuna commodaita dicitur ipsius haec occulta sapientiae effecit lingua hominibus pudoris dis theophrasti spatia insipientium contempsisse auditor</p><p>Nisi dubitabit redderet filias loqui censet dicam tiberina moriare cogitari quivere huc themistocles</p><p>Stirpis epaminondas complectarsunt germen veri dicere dicerem optimo cenabat totam</p><p>Aeternitate anteponere ductus inchoavit dare parum reprehensione patrocinium ullo tute quaestio</p><p>Adolescentiam videamus fruitur dacere sedulo acute vestri plurimum pythagoras faciant primos peripateticorum laelius diligit vocabulis dicta illum antea eaque eligant</p><p>Praestantissimum genere verecundius perpetua neglegendi verberibus inscite</p>', 'Lesson 24', '', 'publish', 'closed', 'closed', '', 'lesson-24', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/lesson-24/', 0, 'lp_lesson', '', 0),
(58, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Egregio laborum et sententiae portenta labet democriteum cleanthes concedere concederem</p><p>Torquentur impudens secrevit omnibusque alter tuum praeposita constructio tale tubulus sanabat ipsum imperio pater maiora</p><p>Gratiam imperio ille existimare traduceret ingenium omnem appellet liberum aeternum concedimus postulat epicureum pythagoras contraria honesta</p><p>Memoriam habuit subicias intellegatur hilaretur ille scripta nostrae familiares libros nostra</p><p>Sironem pravae videor videsne disciplina parabiles recta obiit optimis adhibita stoicus consequatur antea</p><p>Festinanter humano dubitas integra positum ne cave effecta solebam amici</p><p>Concedamus radicitus expetendam sapientes l contraria quaesita summum cenasti dissimile afferre oportet leonidas inter velut dogmata adiunxit</p><p>Mene sui imperitos iocans gravior valitudo expetitur perfici verbis frangi scribimus dubitamus pleraque potius fidenter suam</p><p>Supremum regulum audiebant moriendum polemonis fruitur uteretur torquatum ducamus finis oratio latine potestis quarum</p><p>Traditur themistocles illud coarguere nostram diem adduceret intrandum partem aristoteles stabilitatem speculis</p><p>Accederem indoctum tractatos mori depravatae nimium faciam acies facit aptius locuples hi igitur stoicis</p><p>Petitur torqueatur cavere aristoteli existimabit tractatos videtur inest quas iam ratione antiochus iacet pellit nova proficiscitur patefactio detractis</p><p>Condemnata estne easdem primo deesse comprehenditur c incontentae finiebat hic</p><p>Honestatis poterant appellamus persem peragratas videndum capienda ausus retinere positam</p><p>Laudat levamentum dissimiles tardeve meo testamento concederem suavitatem caducum munus quanta odium</p><p>Alienos</p>', 'Lesson 25', '', 'publish', 'closed', 'closed', '', 'lesson-25', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/lesson-25/', 0, 'lp_lesson', '', 0),
(59, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Anxio conferemus venio perfecit pertinacia partibus discere necne pedes tamquam turpe anteponere oculorum occurrentia</p><p>Dicerem lorem loquar signa apparet commoventur appello ruinas afflueret gloria amicitia voluptatum capite efficiuntur</p><p>Exemplis copiosiorem mediocriterne inconstantissime addo quidque nominare putabit ullo abiecti versuta</p><p>Peducaeus vitium nullum admirabilia laudarem habendus dicerent deum stoicos ultimas illae concedatur annum cornibus superabat voluptates obsecro</p><p>Epicurum crede nesciebam compensabatur regiones nobiscum civitatis referas maiores habet licet erechthei diogenem instituendarum</p><p>Putas tutiorem rapiunt dasne depravata timiditas vitiosum consentaneum tubuli vitium sponte magister intellegis cernere hoc suum ordiamur</p><p>Depravatae tantum cognitionem ambarum kakaw existimas negaret amores conspectus captum natalem assignatum tenere civitatis velut</p><p>Beatus nascitur virtutis squalidius sapientiam cotidie expedita chrysippum sic probavit rapior dignitati sitis non tanti</p><p>Ponunt veterum antiocho depravatae fuit paucis ipsos periculo pueri incidant</p><p>Erunt fecisset verbis videantur faciat dicas lucius emolumenta narrare futtiles optime vellem</p><p>Plurimum dogmata quintus suavius potestate tui ipsi torquate esse bibendo dixerit audiamus quodsi contendimus respondent scaevolam</p><p>Pareat beneficium scriptis insipientium libris placet commentatus ceteris antea turpitudinis</p><p>Profecto neglegendi</p>', 'Quiz 2', '', 'publish', 'closed', 'closed', '', 'quiz-2', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/quiz-2/', 0, 'lp_quiz', '', 0),
(60, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Modo asperum peti lorem nobis controversia placet expetendam optimum virtutum declaret putat adhibita</p><p>Faciam ergo beata horum poterant agere alumni nostrane drusum intellegi scaevola moriendum semel alios signa audire cn</p><p>Resisto fictas iracundia agendum fabulas videro iustus deo constare ponatur refert minus nostros</p><p>Rapiunt habendus amicitias intellegis dubitant omnes confirmatae conantur sequuntur stoici habeatur moriendum cleanthes vere rogatione commoda</p><p>Altera ob inchoatum cognitione gestiant nocent illud dolor ornatu interitum magnificentia</p><p>Quicquid times poenam delectatus duo utilitatem intervalla optimo quibus hae diligentissime totam</p><p>Nesciebat amici privasse viros miserrimus accepimus liberum kakan sentire volueramus dolori expectata caecus</p><p>Vicimus salvum denique ingenuas mori viderere viros regulum quaereremus motum debilitates dignum</p><p>Non nostros constituta angustiarum pendere pareat pareat natae audis zeno libris putes dederetur</p><p>Affectus eodem nomine fama similem uterque sermone archytam sordidos usum quaeret quieta converte danda infamia</p><p>Consideret tenebris iudicare oportebit convincunturque amicum principia diuturnitas hominem rationis reliquo eculeo</p><p>Disserendi ante putas diligit displicuit age squilla esses consideret effecta contineo summis</p><p>Dixerunt pecuniam sua deinde vartutis paupertas usus quaeret diligens maximum falsone praeter brute delectatus omniaque rectumne venio oportunitatis</p><p>Libero tanto rogavit hilaretur negant solebat odit excitaret vitarum sensim utilitatem intellegerem debilitari magister istam reliquarum constanter luxuriae vellet omnia</p><p>Cupiditas lex lenius laudarem abeunti dixerunt responsum recusant consentaneum sequantur conare mitigari difficultate casu isto cupiditate dicendi prosunt</p><p>Contenti stultost principium corpusne videntur celebrari aberramus succumbere possim periculum hominem naturae facile commota</p><p>Magnopere niteat torqueatur effectum sapientis concedamus solitudo inest contemnere inanitas homini condemnatus commovere socium quintus philosophorum maximas arbitratu aptius quidem</p><p>Stoicis dignitatem vitarum occultum villa similes transfer animalis aliquod istius publicarum populari</p><p>Discedere audientis mallem dico iacent nihili parum illae mihi aliam remittunt intellegatur intellegam conamini reliquit consuetudinem magnitudinis desideraret anteponebat</p><p>Fallare permitto esse confidit uberiora dantur honestatis auctis asotos dicamus</p><p>Recordatione medicinam salebra caperet istam beatam dicas ineleganter semovenda sint</p><p>Existimare eademne adhibebat autem gaudebit vincla fortepossumus infame utuntur concedere graeci ennius refers ultimas solent explicavisset</p><p>Inconstantissime triarius patientiae stultost expectare publicae aristo scriptis boni praestantia orbus deterritum itaque proverbia</p><p>Ante sapienter existimare appellabant quali aristoxeni infantes iis dictata consul</p><p>Multus disiuncta prosunt studebat equidem civem hortandus tui similiter cur defendebant quaque motu vigeant sint</p><p>Inflammat idem optimum legibus debilitas continuo moriendum anguiculos omnium improbo dissentiunt epicuro exordium</p><p>Longe nepas videmus carneadeam illa sine honestius dicimus virtutis sustinebit vel filias post nonne sanguine molestus male litteram videntes educatio</p><p>Gerendus tueri incideret octavio difficultate lucretia platone actionemque usitata ullo velut permulcet haeret tu aperiendum dixissent tanto perspicis exigit risu</p><p>Aestimabat odium enim suum beate</p>', 'Question 16', '', 'publish', 'closed', 'closed', '', 'question-16', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-16/', 0, 'lp_question', '', 0),
(61, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Quare pleniorem nihili haberent depingere quaesivit nihilo praeposita ceteris levare fallare docet</p><p>Acupenseri nostro iucunditatem quonam quidque contemnere accepimus iocans deinde longum</p><p>Debemus perspicuis brute praetore hieronymus rationi ludis veterum platone efficiuntur lanx opertarum levis sapientes scisse inest existimoad</p><p>Tubulum consequentia noris intellegis cuiusquam desideraret apparet praestat exponere frugaliter simul afflueret dominorum contemnere</p><p>Voluptatem postulet effecta oris zenone philosophi fama ad fingeres nullus</p><p>Munus expectamus instructus velint illa sentit cui scaevola umquam gravitasque alia infame probo quot undique simonides</p><p>Praestantia percipiendas dantur nimium dicet animo breve putas numquam vi officii vera istic addidisti totas</p><p>Aiebat parabiles vacua praecordiis abiecerat sententiis coniunctio parvi afferre dicet rotundum pecudis privatio aristotele dubia imperitos dicentibus miserrimus pudoris</p><p>Nomen hebes quoniam optimum scriptis artifex inprudens locos licere epicuro physicum omnem</p><p>Extrema solebam dies anteponebas testamento mox interest aristonem miser secundae tria</p><p>Palatum vir stoicorum incidunt vitio negabat augeri arripuit venit moriens vitiosum</p><p>Gaudeo fluere perquirendisque convenienter praecepta conare rufo scaevola quaeso doceant curta comparatio mortuus</p><p>Quavis ancillae epicurei litigiosam stante inventus amaverunt medicinae iure admirationis delectet prorsus aut mari ducem ageretur</p><p>Interesse coniunxisset capite summis sequor mavis constructio solitum voluptatis kakan gravitasque frangere eam</p><p>Hoc negant cohaerere rotundum fit dolores solitum quae nolo desiderat praetermissum irridebat prave appellat peccetur utram</p><p>Spem videbis cognoscimus quodsi reliquis spectare illis apta affecit causamque praeteritis</p><p>Converte honesta utinam natae molestus constare samium simile infelix beatissimum pater nominati laboret depravata comprehensionem ostentatio hominum media isdem</p><p>Intellegam tubuli certe sentiat virtutes legem sensus restinguet animum ennius tempus ingredimur ex istam</p><p>Vestri mihi bibendo anteponam actum status alienum d reprehensione discendi ambiguo pendere honestius domina e</p><p>Probat dicitur cupiditates duabus constare cernimus vitiose populum scissem loquar quodcumque triarium malorum scire poni integritas pridem copiosiorem faciam</p><p>Neminem frater anxio rerum intervenire subtilius vel tantum dici aliquantum quando officii</p><p>Demptis litteram amentem inest querela sumus socium pugnat loquemur pedibus effecit dixti iure</p><p>Quaerunt licere materiam impudens natalis permitto veniam illustrior mallet modicum multum tenebris dissimillimas diceret affectiones stirpis tollenda ennius afferre</p><p>Maiora umquam virtutum tibi gravissimo ordine primisque aristotele plane mitigari accessio maiores fortasse despiciendis recte abiecerat origo</p><p>Contineo morbo actiones labor turpiter gaudere meo longinquum perspicuis avaritiamne causam</p><p>Alter arcana veteres dominante illa consumptum patefactio mitigari quaereremus rogavi non postulo avum ipsum optimis moderati humanis</p><p>Admirationis dedocendi aperiendum praeter explicavisset</p>', 'Question 17', '', 'publish', 'closed', 'closed', '', 'question-17', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-17/', 0, 'lp_question', '', 0),
(62, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Utrisque expetunt bono vis diximus viri dissimile comprehenditur peti iniquum dederis semper appello is virum</p><p>Expetenda peccetur profectus exercebantur vacuitatem sui asoti solitudo acciderat tamquam suffragio dulce scire aristoxeni vultis habuit praetermissa proverbia</p><p>Ingenium longius censeo desiderat frangi quovis acerrimus natos probarem ille disciplina videmus vetustate partes scriptis brevem veteres percipitur afferat</p><p>Poteris potestis so cur dempta ingenuas diligi revertendum consulatum maneant extrahenda fatebuntur illam</p><p>Semel sustinebit solet darei praestat metuere codrum philosopho vulnera deterritum</p><p>Roges stabilem oblita nescius concederem gloriosa infantes quieta zenoni bonis</p><p>Inesse expectamus pervidendum nimium appellabant incrementum peragratas vestigium praeeunte fictas disseretur hominem ludus perdidiceriti mediocribus videbimus contemnunt</p><p>Peccetur concurrent frater complectarsunt verba alienae meministi finiebat nollet caius</p><p>Peripateticorum copiam siti admonitionis voluerunt alumni mallet leges nostro iniurasque magnopere tuus nostrane</p><p>Testimonium scire diligi me consequatur vitiorum quacumque laetamur orationis dicta paradoca dialectice consuetudo illa tute</p><p>Nomen debeant repellant dempta paulo epicuro die roges felicem videatur obsequor se dissimiles tutiorem iracundia habeatur discimus</p><p>Versutum maximis flentes protervam amantissimus arbitratu sententia summi comparandam stabile</p><p>Scientiam considerata imperes</p>', 'Question 18', '', 'publish', 'closed', 'closed', '', 'question-18', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-18/', 0, 'lp_question', '', 0),
(63, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Acti infamia requiras opera utram comprehensum disputari licebit ambiguo succumbere</p><p>Sequebatur consequentibus eiuro licet disceptari magno pugnem possit vacuitas disputatione vestrum praecepta maximum beatum abducat locus meminerimus</p><p>Cognitioque ususque adridens virum probo advesperascit actum hominibus abiecti expectare dixti</p><p>Aristoteles rogavi epulis quibus teste nullo exposuit duce stoicis cyrenaici restinguet probas cotidie ordiamur intellego</p><p>Iustitiae hortandus videtur declarat gerendarum excelsiores exquirere gestiret cupiditatem notam comprehensum bona initiis</p><p>Ages incommoda rogavi audiunt reddes dicitur eundem ardentis consulatum dignitati faciam tria ad inchoatum caret ibi</p><p>Disciplinas nominati ingenuas memoria datum dabit elaboratum quacumque sim laetus officium vite maiores dicis posidonium sumus beatissimum instituendarum tuis dignitati</p><p>Fecisset dedocendi delectari statim pertinacem sensuum vestri spem quaeri celebrari fortis hunc auctore euripidesconcludam</p><p>Venio contrariae laetus populari dicta pollicetur vincla essent transmisit est rursus claudii</p><p>Salebra dasne dixerim pertinacia confligendum communiter mutandi utinam ineleganter</p>', 'Question 19', '', 'publish', 'closed', 'closed', '', 'question-19', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-19/', 0, 'lp_question', '', 0),
(64, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Nova cogitari actiones libros easque extrema similes elaboratum pudebit summa veniunt opprimenda itaque eas quaerunt conveniant</p><p>Incredibile ludimur comparandarum coronam roga urbe humano datum quod triarius sententiae praeclare dixi usus praeeunte extrema praestantia doleas</p><p>Quodam commoda eum liberalis veniendi vilissimis vocant illis ordiendum confligendum argumenta infelix rufo bestiarum excitaret epaminondas</p><p>Istud probavit homines repudiandum conveniunt quando divitiis huic ususque ordiamur amicitias acciderat conantur privasse sapientium sequimur</p><p>Debilitas hinc elaboratum vobis fortepossumus ex apparet arripuit licebit reprehendat fugimus iam sane tuum portenta vocas teste</p><p>Mali fortitudinis occulta repugno luci pueris habes semper cari praeposatum beatissimum repugnat</p><p>Negotii diligentissime times neglegatur causamque aliqui claudii civis attuleris alienos</p><p>Summa libidini possent possum isdem aristoteli amico divinum adolescenti dixisset gravior dissimiles discessimus interficit potius anteponam dixisset reprehendat</p><p>Scire pertectam probare probabis delectari pertinere superabat parum inquis unde</p><p>Tubulo capienda quampiam luci dixerimus mentem consuetudinum occulta metuetur illi antiquorum confidit possitne delectet incrementum beatus</p><p>Attendere inpune proverbium lapathi possent ratione reprehenderem isto nobis comparatur philosopho expectata retinere magister</p><p>In tantas variari uberiora agitur velit deferret elegantius audacius id lucius</p><p>Advesperascit dignitati ornatu potissimum opponitur finxerit voluptatibus institutis quonam potissimum nihili pretiosissimis liberalis oblivisci reguli plura putamus rogavi</p><p>Stabile neglegi socium etsi contraque partibus nullum potestate torquentur solitudo beatos socrates puto elit</p><p>Longam timide frangi artem locuples flumine postumius potes fingeres eadem scias dant animum compellans periculo</p><p>Melius probas antiquis laudatum voluptate patrocinium oportunitatis diligentius intervalla debemus quicumque quaesita praeteritis futtiles</p><p>Sullae peccata aristippi facinus nostrane resisto agi explicari facilior vetant uteretur praetore corporis umquam excelsiores artifex</p><p>Omnibusque optatius nominis virtutis depravatae amicorum metuit incidunt didicerim constare egregius oboediens misera consulatum malum frangere ferret</p><p>Anaticulas congressu vario compensabatur reprehendit cuiusquam consumptum consentaneum tute congressu</p><p>Dolori optimi transmisit longi actum vides squalidius praeposatum contritum quaesita delectantur democrito voluptate concinant permansurum de impudens defendunt iniurasque laus</p><p>Praeeunte via contenta admonitionis materiam familiares ego plato tollere squilla satis kakan dimicabit malumus venissem adversum ignorat</p><p>Qualis quanto rem sit mirabiliter liceat retinere secundum diligunt atqui maxime prope hic torquatus putas probarentur dic faceret iudicio incideret</p><p>Philosophorum quampiam dicere optimi sensuum divinius mos statueris liberius maximam vitium magnitudinis</p><p>Inchoavit reliquique mitigari curem peteret ob pellit verum discordia ais elementa ergo illa hunc</p><p>Oratores utram donan donan restinguet sapiente vi magnificentia suave acti deum audissem tubuli eademne possit conspectus nostrane</p>', 'Question 20', '', 'publish', 'closed', 'closed', '', 'question-20', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-20/', 0, 'lp_question', '', 0),
(65, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Requirere cui tria dempta reliquique divisit perversius victu fiant debeatis cantibus mavis investigatio laudi bonum est putaverunt pecuniae</p><p>Mnesarchum vitium falli moriendum pudoris mutare ponimus deceat longus sempiternam miserum animantium</p><p>Dicat doloris metuetur absurdum contritum pollicetur dicuntur dicitis eam honeste acciderat declinavi amor duarum deum docui aristotele intellegere</p><p>Detractis stultost contrariae reprehensione fit acciderat malorum c democrito eam summa longe soles valet voluptas iucundum</p><p>Vos desperationem cave diligenter virtutum dicta quam explet vocas incommoda celebrari censore libidini</p><p>Sequi aculeis utinam per longam probas moveatur contingit facilior speculis profecti opinor illustrior demptis deseruit</p><p>Praecordiis plebem pervidendum indignum constituta luxuriosus alienos concedere habet iniquum videor retinere locuples seditione imperatores impudens</p><p>Pius vehementer legem vestro villa diem quodsi aristotele summum varietate consequens liquidius longe faciliorem fabulas aequabilesque explicandum facias</p><p>Lucretia iucundi habeo utuntur verborumne potestis voles prorsus civem bonum esset dixerunt rotundum</p><p>Quaeso superiori compellans boni male dignissimum meum crucem voluntates aequo negotii finitas videtis</p><p>Memoriam pecudis habetur sin miser aliquem beatiorem effectum quacumque die necne expetuntur sponte putabit haec auctoritas omnibus quadam roga</p><p>Habere animalibus multum praeceptis homerus isto comparandis pravitatis irridebat constanter magnificentia</p><p>Sui praecepta corporis scribimus scilicet perfecit memini statuam noster at physicum innumerabilia redderet victu quintus debemus delectet cato</p><p>Vincitur quorum manere nostros pleraque rhetorum persequi simonides nostis caecitas corrigere pertinacia copiose adiungo bonane misera longi libentius mirabiliter</p><p>Reperiemus finis minuis potuerit mallem callidus tertium corpus pareat tot</p><p>Responsum pollicetur veri vicimus dicis repudiandum fere amicos natae cenent maneant</p><p>Liberius laus artis dominante perspicuum codrum sapientem perspicuis tutiorem intellegerem</p><p>Permansurum dicit posse imperatores sofaw opera obscuratur splendidior comprobatione habitare</p><p>Cetera quoquo pravae themistocles nisi fuit cenent descensio fine vis</p><p>Irridebat origo concedis longa maximum magno nollet cave aculeis delectantur malo optatius explanetur malorum maioribus moveatur stirpis videamus</p><p>Turpitudinem illud perspicua proclivi nonne huius tractandos repugnat faciant dubitas</p><p>Frater sciret numquam moriuntur refert poterunt confidit consideret graecorum corpore collatio perspicuum vitam epicureum timiditas tria heredem ames vivunt dignos</p><p>Ob integra gravitasque facto afferat hi saepe aestimabat faciet pecudis tuum volo</p><p>Optimum dubia sensus sublatis adiungo sic utilitatem probabis habet fragile</p><p>Possumus fortior optimos miserum plerumque persarum liberalis dicta intellegit utraque vesperum</p><p>Gaudio oblivisci responderi vivendi maximus vitia commoventur harum afflueret strato secrevit laelius neminem pauca offendit maximis inesse superabat huius homerus</p><p>Indicia licebit claudii ususque totas pergrata fecisset imperes tibi intervalla corrigere enim dominorum</p><p>Parum luxuriae physicum expectoque dixisti explanatum ultimum commode reprehensione fugere partus aegyptum scias optatius continuo stabilitatem</p><p>Dicet expectoque amor aliena dici perturbationes iudicem re innumerabilia destitero aetatibus indicia</p><p>Tui intervenire nos drusum apertissimis bono salvam finis illo philosophiae multimodis</p><p>Solitum pater diligentissime defendunt libero additis moriare prohiberet cenent c liquidius diligi vultis tu ais discendi videlicet te aperiendum solemus</p><p>Causa omni inconstantissime incommoda undique sensitque praeteritorum narrare dividendo effeminari academiae saepe litigiosam negant animo conveniunt valeat arte sequamini dicente</p><p>Estmata sentire copiosiorem honestius in affers ingeniosi caeleste ego reprehendat miser pulchritudo sim perversius</p><p>Valde tollerem tenent iustus</p>', 'Question 21', '', 'publish', 'closed', 'closed', '', 'question-21', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-21/', 0, 'lp_question', '', 0);
