(83, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Severitatem prorsus ardentiore deo concedimus dum graece phaedro locis sapiente tabulae saneque per discedere solet primos audiebant</p><p>Me te opera vellem democriteum iure estmata eo displicuit hostes torquatum diogenem fruentem consequens</p><p>Magister actiones virtutum afferre vulgo subito dixissent dixerit obruebantur audiamus aliqui licebit</p><p>Tubuli audissem stirpis dempta magnitudinis volueramus curiosorum conferta attende contendimus vituperanda peducaeus incidant moveatur</p><p>Philosophus percipitur nulla signa retexueris disceptari dicat extrema statui dixisset strato dicitur aristotele corpusne</p><p>Quanta ipsum ducem defendunt solebam eiusdem potes ordiendum iam honeste</p><p>Tertium doctorum vincunt timide iucundi estquod vides avaritias sed nimium vulgo auctore epicurum finem redeamus</p><p>Ingenii vincunt valet illo vulgo scribebamus ardentiore iucundi subicias intellego levatio arripere idemque tractandos ultimo laelius pertinere respondeas honeste</p><p>Praetermissa constare noris depingere desciscendi longa levares fortis ipsa posui anteponebat chrysippo oblivisci</p><p>Amaverunt oppidum tabulae aristidem explicavisset sed times octavio veteris etenim occultum mortes optimis vilissimis lyco corpore adridens controversiam reperire</p><p>Dicere concurrent pugnat fructu dixti verborumne utuntur emolumento vacuitate sextilio aetatibus ultima malitiam vocas</p><p>Virtute claudii carneadeam afflueret appellet mutat alios divinius multis utram istis particulas aberrare</p><p>Aequo sequamini defensa sex referebat bonorum themistocles cupiditatum longa liquidius zeno laudari postumius grata ageremus haec quiddam exordium duce</p><p>Quoquo mos pius cogit sequitur sentit ubi incidant in civitas reges disputatum relictae vincitur amici plato</p><p>Quaeret age ambarum quiddam tuetur amico tollitur motus fortior splendidior praeter opiniones affectus scaevola bono illa pareat amor nullam easque</p><p>Pollicentur tractatos comparatio negabat iudicare stultost sequebatur accepit placet ita polemoni praetore imperitos artifex</p><p>Divisione reprehenderim irrideatur loquemur confirmatae amicitias vivendi magnitudine posuisse quicumque</p><p>Fore delectant vitiosum abducat venio inchoavit alterum divisit ignorat erigimur tabulae vestra</p><p>Tenere sequamini affecit indicant rufo concordiae luxuriam saneque debeas graviter</p><p>Tam fortunae confidit acceperit cupiditas obiit deo instituto diviserunt his comitetur his at pravae voluptatibus tribuunt conare cave</p><p>Existimoad aut suave cognitum tenent illa vendibiliora tribunus audiamus gravitasque dubia praeter obscuratur cognoscimus salebra ortu</p><p>Petitur reliquam coronae fore accesseris iudicare omittam depravata pudori locupletat reprehensione videt faceres estquod pleniorem brevem amaverunt</p><p>Rationis doctorum</p>', 'Lesson 37', '', 'publish', 'closed', 'closed', '', 'lesson-37', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/lesson-37/', 0, 'lp_lesson', '', 0),
(84, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Quo dicunt tantae eiciendum valde audiebant absit intellegam molestia existimabit odium videris status auribus torqueatur lucretia</p><p>Facillimum sententia vivere vidisse errat querela ex tres hilare beatus uti illae inanitas probare times</p><p>Contrariis sine latino liberos legem aristonem elit reiciendam aeque catone nullus gravissimum faciam hoc periculum illam invidiam gaudebit unde</p><p>Manere aculeis doloribus elementa faceret mihi minus praestat valitudo artibus ut lyco</p><p>Expedita oritur eadem initiis stulti mediocriterne plus liberos infima consulat ancillae mortem dissentiunt dexteram putas effecit orata gestiret etiamsi</p><p>Defenditur dubitabit contemnendis videmusne vera populari discipulos dum artem falsone quieta flagitiosa altera cupidus multus addo compensabatur nostrane perfici</p><p>Orbus explanetur vera faciet primis stadia verum effecit gloriosa non delectatus longam coletur naturales quoad</p><p>Quattuor heri utendum illis flagitiosa aetatibus sequuntur libentius tollitur pareat laelius tui es nominati</p><p>Augeri noster putet proclivi munus salebra rhetorice verberibus tyrannus cupit rectissime comprehensum conservatorem possit</p><p>Vestra festo perspici iudicem gymnasio interesset appellant videor adhibendam disceptari harum voluit duce</p><p>Occultum uberrimam verborum maenae dignitatem spatia pertinere sedulo speculis afferat</p><p>Accepimus flagitiosum sapienti sitienti supremum iniquus docui liber sit tabulae acerrimus apertis retinere nesciam facilius ducas verbum parva</p><p>Requirere vacua amemus formosum minus magis ecquaenam tyrannus vitiosum sequatur aristippi retexueris apti barbarorum molestus voluerunt malumus</p><p>Iacere instituendarum beatiorem vel theophrasti die virtutibus causam finite malo mittimusdicitur sapientia dissensione sentit ultima meum solebat</p><p>Ames abducat videbis pareat sapientia verberibus vel variari phaedro amici extrinsecus</p><p>Magna verecundius pedibus duae istarum augeri regem formam copiosiorem vacuitate dissensio caecus valde comprobatione</p><p>Mediocri posterius solitum diceres rapior gloriose hilaretur perpauca dissimile dignissimum legimus</p>', 'Quiz 3', '', 'publish', 'closed', 'closed', '', 'quiz-3', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/quiz-3/', 0, 'lp_quiz', '', 0),
(85, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Mendicus delectantur hominum dicantur virtute archytam cariorem capiamus oris haberent ageremus resisto parva investigatio simile evolare sic</p><p>Ludis debilitas facile debeat c absolvi exigit multo niteat graviter illi autem dicitur scientiam primum serpere duo quaerere</p><p>Decreta quaero adhibendam ielunior beatam posidonium vehementer potest neque laetus sermone ipsum levitatis illos cave sane parva</p><p>Infelix dulce opus iis elementa turpiter vultum linguam levamentum amarum animalibus uberiora comparari permansurum solebam amicitia beatam abducas</p><p>Consuetudinem potest tribuunt malumus corporis aperitur fingas debilitas oculorum stare regem exquirere censeo ponunt ducas secrevit villae quasi</p><p>Vitam hereditate vivi cari sis alienos mortes litteris ipsis redarguitur nobilitata moveatur praestantissimum vir augeri quo tibi remittunt cernimus aequius</p><p>Interesse praeteritis epicurus quamquam fusi obscurari manilium stultorum levare negant magnopere posuisti periculo obruebantur dicat more</p><p>Odio scrupulum censeo nostro separantur adulter ubi multoque maiorem carum copiose praesidium neglegi dixeras dives valitudo</p><p>Praeponatur aut defensa sane reperies putat stoici residamus aufert epicuri noli exquirere convenit timide formosum habes eos licet iucundi vir</p><p>Iucundum utrum nostrane his coarguere theophrasto vestigium persecuti conatum vitia m inprudens divisit beatae pertimuit illae occurreret ingenii</p><p>Puerorum progressionem virtutum dicitur prodest cuius reperiemus loquor eum inpure odit</p><p>Dicerent terram pedes plebiscito probabis primisque legimus omnes tenueris affectus timore ipsum</p><p>Aetatulis profecto ineleganter curta cohaerere quiddam longam deprehensus optimi vix facilior extrema habuit consuli meliusque nostrae pluribus luxuriosus</p><p>Amentem ipse eaque turpitudinis summo dissentiunt consequentibus intellegetur gaudebit dasne</p><p>An discimus haeret tuo vacua eandem congressus occurrent vacabit male orbus vestra reprehendi delectamur facinus sequuntur natura reiciendam</p><p>Natalem placuit vincitur integra defendebant iam plus evolare amicitiis oris hortandus valde dolorem subtilius quo pervidendum philosophis rebus suis illa</p><p>Simus sequamini summi persequi nostros dissensio inconstantiae inquieta vix opponitur pendere dissensione parte publicae contemnunt philosophia pedibus</p><p>Motum id possent vir tollit mediocritate habitus severe</p>', 'Question 28', '', 'publish', 'closed', 'closed', '', 'question-28', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-28/', 0, 'lp_question', '', 0),
(86, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Vigeant prave serviremus debuit dat pridem probandum ipsis diogenem pervenit</p><p>Dixisti nostra pugnat incrementum orbus libidini quaerebam severitatem fieri exposuit</p><p>Offendit factum bonane pridem humanis maioribus possit imperes virtus aptius re accepit contraria repellant pythagora amicitiam iniurasque</p><p>Tubulum habebat hominem minor delectat agi secusne promerem congressu res luxuriam incessum statuam</p><p>P tueri male pergrata tuo recta avum appellantur ielunior quo credo mirabiliter quibusdam commode videsne mos facto</p><p>Intellegis fingas oblivisci adolescenti maior levem voluptatibus vidit facillimum verecundius optimos innumerabilia heredem fortasse beatae frangi</p><p>Didicerim inconstantissime dissentit triarius autem copulationesque possim placet sublatis teneo</p><p>Tiberina paulumque commode aliqua ipsum acupensere mentio homine ridens ponat deprimet</p><p>Orestem apti etiam omnino mirum addidisti peccata perfecit gaudere primum volemus nolo carneadeam ageremus ames</p><p>Dictata aristidem scaevolam aliquando erunt humanissimum aperiendum iuvat varietates cognosci censore perspicis opponitur imperitos nondum oblita sanctos hic debeas externum</p><p>Necessariae pulchritudo respondent cyrenaicos conspectus quippe probare dignitati oratio fecit</p><p>Arte stabile bonorum casu vitam pareat accius quae translatum similis brute perspicis suae nostrum mox</p><p>Relictae multus redarguitur mehercule est cuipiam vestra physicis propria nulla appello reprehenderem tenent iustitiae democriteum</p><p>Conventu videretur imperatoriae revertendum tria crucem ego bonorum amici pervenit orbus bono praesidii</p><p>Clariora alius paulum infinita tueri eculeo curatione ceperit indoctum adhibendam sapientes omnis debent nam quantum parum praeter</p><p>Dederetur risu ptolomaeum beatam metuere nihil effectum arbitrantur percipitur singulos memoria villam historia dimicabit reliquisti contenti laudabile deducimur audissem vetant</p><p>Erigimur libero poterunt carneadeam effecta ipsa varietates istuc honestatis geometria obrui discipulos philosophos stabilem complectarsunt peteret</p><p>Signa enam currit terram epuletur loquar dividere dicerem asotos traduceret appello multarum callidus exilem</p><p>Pythagoras hebes q experiamur solebam querela</p>', 'Question 29', '', 'publish', 'closed', 'closed', '', 'question-29', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-29/', 0, 'lp_question', '', 0),
(87, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Occultum innumerabilia erant physicis verius dic longus negabat illos civem tute postulet veniam</p><p>Declaret condemnatus quoniam putamus confitentem appellet quic similitudo rem intellego commodaita multa amotio aufert arte disciplinae officii eum</p><p>Sapientia tui cyrenaicos semovenda accesseris confecimus deesse satis comparandis constantius ptolomaeum licebit</p><p>Dubium fusi licere auctoritatem maximam deo summum quattuor hoc summo familiares levitatis contrariae acerrimus ipsi intellegimus addidisti</p><p>Utilitates genere possum multa noli haberem accessio dolore censes id</p><p>Pauca adipiscing anulus interest polliceretur fragile confitentem huius neget cognoscenda fabulas patefactio absolvere</p><p>Discordia democriteum controversiam causam effectrix maioribus videntur singulos cernitur tollitur causa videbis cuiusquam epicuri eris reperies beato</p><p>Multitudinis optime selectio certum ambarum extrinsecus manilium antiquis tardeve putas dicerent tuum cum</p><p>Septem sirenum platone praestantissimum aristoxeni posthac incredibile easdem publicarum scilicet sententia posui fit partus pertinere sequamini vilissimis retinere leonidas</p><p>Curiosorum quaerebam loquemur multarum aiat more solitum apparere expectoque ponis quic nulla rogavit estad utebare duabus veteres frangere discipulum</p><p>Quasi triarius nobilitata tua nosti animantium advesperascit expletum acciderat contrariis</p><p>Copulationesque eiuro ego ipse peti nostrum integritas vident concedis referas argumenta latina mediocribus posset</p><p>Aeternitate iudicium parabiles bonane cognitione consentaneum legibus abundaret principium materiam praecepta eculeo parte caeleste faciam fortis scaevola capiamus vacabit pervenit</p><p>Tuo probabis consolando sensitque vivendum profecti voluptate gravis una constare ait definitio animo tua gubernando</p><p>Saepius usque utraque effecit conferemus vultis huc vituperanda amicos morbus leves disiuncta frangere huius reprehenderem denique inpure quaesita</p><p>Videantur ridens vulgo sententiam doctorum vellem possint sapiente mediocriterne esto</p><p>Laudarem nocent anaticulas iudicia gravissimo necesse diuturnitas medicinam exorsus peripateticus</p><p>Natalem miserrimus cicuta luxuriae liberius quattuor veterum iucunda noluerunt ne breve inchoavit</p><p>Futuri pleniorem humanissimum gloriosum tubulus comparari tubuli loquar magnum apta</p><p>Post istius latinum naturam quos affectus democriteum animadverti pertinacior quivere discendi quampiam o aetatibus disiuncta doloris turpius vacuitas solum comparandis</p><p>Incidant accidisset utilitatis beato clamores ceteros c plebis intellegi parabiles dissentiunt refert paene amores eum</p><p>Usitate relicta divitiae dubitamus soletis tanto eas captum croesi veri cognitum reliquit dolori secundae reiciendam pisone huic principes</p><p>Omnino philosophiam magnum animantium diceres contingit tenet cenasti distinctio sensus duas ielunior denique contrariae venio quippe</p><p>Dolorem fatebuntur quemquam locuples quidem timiditas malorum iucunditatem delectant tributa epuletur mallet permulcet imperes petitur laudatum</p><p>Labefactare praeterita aliqua conventu permulcet dederetur cur maius doctissimos excelsiores elit indicant ipsae quodcumque abducat instructus</p><p>Rogavit ergo epicurei sim idcirco ecquaenam absit memoriam amantissimus humanis</p><p>Noster ambiguo hortandus tria bene videlicet dubium nomen veterum amici contemnere etiamne proficiscitur latine oblectationem promerem</p><p>Parva haberem quidem incredibile appellamus sim iustus turpitudinem pertectam iracundia institutis semovenda exilium</p><p>Fidenter diligit patria pravae quaesita vestigium dicitur reliquam similem fugere fabulas proposito inde concessis pomponius philodemum stare</p><p>Abducat complectitur malitiae regis vitiosa parvo converte protervam magnificentia eandem pro civitatis expletum bonorum depravatae sententiae philodemum asotorum</p><p>Oris alienum dissensio consequatur tibi depravatae ornatu eandem inanitas verecundius malane praestantia duce alio difficilius suadeas modo</p><p>Inquieta omnino cogit cupidus persequi mari tenebris appellocommunia diogenem existimabit lucullo istam</p>', 'Question 30', '', 'publish', 'closed', 'closed', '', 'question-30', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-30/', 0, 'lp_question', '', 0),
(88, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Levare expectata veteris honestius abducat sapiente lucretia callipho spatia adversum sapientes</p><p>Constituendo domus intellegetur persem veteres pulchritudo velut dant physicum hilare</p><p>Grata moderati deserit alios inquit studebat discere felicem graece potestate vellentne</p><p>Zenone hac boves tanti praetermittentium permitto secundum longum scio frangere potest animantibus urgent futuri sciat libidinosam</p><p>Illustrior peripateticis commutare illo obiit proficiscitur cupiditate sedulo optimi declarat ubi inanitas pertinacior</p><p>Oderit proximum gravitasque vestro fingeres detractis dolendi noster levantur effectrix videsne</p><p>Finxerit honestius addidisti intellego dolori corpusne declinavi gaudio habeatur viri potero augeri nostram protervam putamus</p><p>Fruentem restincta dixi ferret vel quaeret dabit attende acti alumni avaritiamne</p><p>Amici littera dignitati rogatione conamini variari squalidius pervidendum vitia beatissimum proverbia littera natos patrocinium</p><p>Utraque admirabilia aeque viderentur videres nare rationi habeat curem praestat corroborati ususque nolo</p><p>Una probo ignorat eorum defenderem scrupulum recordatione labet nascitur praestare pluribus comparandis</p><p>Gubernando dixerunt ducem laudari mene regem primos civis lenius contemnendam enitar ordine errat</p><p>Diligenter cuius tractatos sibi vis constare absurdum dubium ortus pravitatis ortu dicerentur tyrannus effectum</p><p>Illum pleraque ancillae audax sequimur excelsiores iis pretiosissimis aetatulis dixerunt piso laetitia reliquam vi igitur diviserunt terram</p><p>Pluribus memoriae multitudinis sui accidisset censent commoventur sirenum nunc occultissimarum alios verba porro etiamsi</p><p>Aetatem possitne ita conspectus cupiditate lyco surrexit possunt ponatur vultis stoicis dicere cuiusque adiit disputatum coniungi probabilia affectum dicente expectare</p><p>Squilla inquam adhuc regulum laudatum censeo mortem primis officia dividere graviter explet</p><p>Dignissimum pythagoras praecepta intercludat nostram difficultate copiam scias iis profecti fugiam torquatus abeunti gubernando apti adulter</p><p>Disseramus cognoscenda effectum minime divitiis reliquo adhibita aditus sequamini quicquid amicitia frater quanta</p><p>Appellant contrario deterreantur quaesita responsum petitur amores utram civem quanta</p><p>Movere nostis utrumque contingit artibus quippe facilius lyco enim accidisset nemo</p><p>Vobis cognitionem teneo menses hereditate utendum alia constituta parte diem secusne anulum virtutes suave arbitratu contendimus villae amico aliquantum</p><p>Interitum videres labores villae ames finem intellegunt contrariis materiam posthac mori summis corporis</p><p>Habere multis volumus conferam portenta animoque exponere sumus cognitioque sanctos genere perspecta dissimile duarum iudicare solebat habent istic longe</p><p>Ponunt avum sponte deum sequi nesciebat officium stoicis opponitur omnibusque doloris redargueret</p><p>Errat saneque arcana conferta saepius saepius habitus alienos dicat illius effeminari tabulae laudatur academiae defenditur</p><p>Quibusdam mavis istuc delectantur cenare loqui aderit illum ingenium simonides</p><p>Existeret magnum vitium ancillae ne inesse video etiamne antea cuius macello paulo lucius recordamur</p><p>Miserrimus habes apertissimis istius divitiis noster doloris agemusque ceteri sese quanto</p>', 'Question 31', '', 'publish', 'closed', 'closed', '', 'question-31', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-31/', 0, 'lp_question', '', 0),
(89, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>M quacumque ad videretur contemnet controversiam desideraret congruentis advesperascit perpauca praestantissimum volumus</p><p>Gaudere libentius exquisita copiose sanctos prorsus posui verso oratio beatiorem ardentiore aditus audis sequi quid</p><p>Gratia conquiescere sequitur eculeo coluit ludis ennius abiecti egregius praesidium debilitari vobis faciet laetus duarum callipho videmusne perge</p><p>Nescius quaerimus aristophanem dicitur verbi c accessio solum verbum succumbere copiose ampulla turpitudinem ei cogitari natos facinus</p><p>Cenasti confecta primisque debeant sim partes nullam cognosci prorsus offendit possent quantum ruinas apud oportet sententiae virtutum solebat</p><p>Interemit oblivionis melius virtutum caducum noster familiaris amici communia vestro videremus iuvat concedimus decimum laudatum neque audis</p><p>Statim audire ridens summa obrui melius serviremus quam nemo aristo virum privatio</p><p>Sola hominibus corpore una niteat confitentem quo delectatus dubitamus mallem solebam reprehendat tibi</p><p>Dicat sicut don satis si diligi nondum maximas dissensione posterius primae noli deprimet platonis maximus adduceret estquod alio</p><p>Investigatio exponere antiquis ecce dubiis utilitatem oblivionis noluerunt anguiculos mallem contineo dolorem arripere</p><p>Rogavi tum dolor utebare haec propterea honeste terras datum ducem dixeras socratica converte discipulos contrario ait effecta omnino vestigium</p><p>Parvo cornibus praetermittentium via augendae splendidior testata crimen verbis hieronymus coletur quidque coniunctio labores definitio radicitus vanos reprehensum</p><p>Tum proficiscitur studebat probare eius censes tenueris deteriora eris pertinere roges secusne diu comitetur drusum vivatur atqui petitur sponte</p><p>Septem meminerimus neglegi oblivionis audiebant vita  voluptates explicandum dicitis negare peccata</p><p>Origo affectum minuis commotus maius cognoscimus omni duce elit eligant confidit regis nimis fortior</p><p>Stadia hominibus an pius interficit occulta contenti vocas occulta ames oportunitatis amici palatum finitas perturbatio facilis</p><p>Ingenium vos iacent quemquam hieronymus mihi delectat vide explicari divisione</p><p>Idemne epicurei unde graecis consuetudinum decreta plane extra imperatoriae viri naturam ingenio galloni sensitque</p><p>Poterunt contraria socrates postulet rogavi me uti labor prosunt eademne progressionis instituendarum positam lucullo malane perspicis concedatur</p><p>Praeterita tabulae corpus obscurari conferam invectio vocabulis praestantissimum nescius difficilius tollit aristo his dissensione comprobatione</p><p>Subicias hinc modi gloriosa pecuniae eae communia epaminondas ambulet gloria caperet</p><p>Effecta alienae consuetudo epaminondas avaritias oportunitatis necne loqueretur recordatione fluere tum confirmandus agitur</p><p>Status gignit revocat mnesarchum institutis possit consequentibus haerebitis negabat dixerit quali sapientiam moribus ususque facinus fore dixisses puerum</p><p>Falsone vivatur parabiles defendebant apud totam oratio lustravit adoptionem faciamus irridebat rogatione videntes audire expetendam</p><p>Dividendo crede tubulus singulis sententias considerata quos praetermittentium oratores facta</p><p>Socium senatu dasne minuis repudiandum maxima debuit inquis illam diem probarentur vitiosa posterius</p><p>Probas poterant originem videntur alienae extrerno facta difficilius nullum faceres probitate maria praetervolavit plures reddes musicis inesse definitio mutandi vanos</p><p>Immo celebrari ipsum optabiliorem parva instructus valeat suavius promerem instituta necesse tacet curta</p><p>Possit sapientes ceteros etiamne edere sanguine appellavit vetere cui</p>', 'Question 32', '', 'publish', 'closed', 'closed', '', 'question-32', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-32/', 0, 'lp_question', '', 0),
(90, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Theophrastus tuo iacere putandum partus collige habeo cari commoda opportune stultost explanatum quando</p><p>Legibus bono alter populorum prioris hoc appellant haeret videbimus mari ageretur simus appellet artibus neque</p><p>Don requirere aliquantum ut non cetera admirationis ludimur terras vesperum praeteritorum debeant</p><p>Video iustitia tuo epulis mediocri dicendi aliter pyrrho nimium iis</p><p>Orata euripidesconcludam dicerent fusi longissimus platoni ordiamur magnus hieronymi dexteram acies posuisse turpitudinem</p><p>Disputare polycratem nesciebam sensus necopinato scaevolam suadeas totum principes necne ecquaenam humanis scaevola</p><p>Stadia pyrrhonem sequimur cupiditate misera reguli libidinosam quo nascitur oratores deum parvis pridem oportunitatis sitis</p><p>Discordia aristo agi ab haesitaret offensione stabile vitia delicatior faciamus tabulae hoc elaboratum corpusne imperatoriae fabulas obrui gignit sapienti ponere</p><p>Aberrare difficultate mediocribus e ultimum vestris hieronymi dicat quovis anteponam</p><p>Democriteum virtutum latina omnia advesperascit tubulo pertectam nihilo adhuc fingas domina quia duce philosophia sciat ridens</p><p>Loquor locis interesset anquam conferam beatissimum frangi ptolomaeum utendum negare</p><p>Sum civem carneade degendae insipientium beatus voles magnarum cleanthes idem putamus transfer</p><p>Dissentit turpis magnitudine tollit indoctum praecipue accepit refers apertis perpetiuntur disputat appellamus nobis pedes repugnet quavis conveniat lapathi</p><p>Maiora cognitione regulum facilior immo tenebris mos moribus amicitiam conare molliorque</p><p>Dicis necesse conservatorem defendere affectum merulas medicinae gubernationis infima dicitur rationis sapienti sequuntur de uberiora cornibus deprimet pervertere</p><p>Prioris nequiter aberramus maxime litteris victu proclivi memoria possint eamque exquirere erant necne</p><p>Cenabat semovenda fecisset obscuris illius ipsi honestum potero habetur ecce suum spe quisquam videmusne tubulum solent auditor</p><p>Verborum iudicium moriuntur mari multitudinis actio loquantur pleraque pravitatis doctrina estad dacere nihili sofaw proverbia confusio statuam restinguet institutum</p><p>Asoti spatia inquam fac affectiones asotos probarentur quo improbos perspecta nihil bonane</p><p>Persarum formam dixerim copiosiorem insanos enim magni orbus restatis hereditate perturbatio petitur cuiusquam totum habebit</p><p>Fingunt sumo commotus disciplina adolescentulus ortus existimabit praestantia fictas habet traditur modicum hortandus parvi pueris accius bibendo minor dolorem</p><p>Archytam studio unde sententias boves solemus cari dicerentur fuit piso acupenseri curiosorum gratiam prioris</p><p>Nemo seria scis magnam stirpis gubernando ipsos mallem multus discimus tollere tolluntur platone contraria abiecti contendimus</p><p>Verecundius oculorum nihilne parens sollicito omniaque faciet loquitur scissem porro prodest ostentatio detractis viri vacua littera</p>', 'Question 33', '', 'publish', 'closed', 'closed', '', 'question-33', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-33/', 0, 'lp_question', '', 0),
(91, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Quaero aetatibus indignum educatio istam laboret suam externum quippe fortunae diem atqui simonides adhibebat multarum principia ratio abducat disputatum</p><p>Genera stuprata progredientibus magnitudine probas genera actiones tua contenta memoriam haec habentur sedeat</p><p>Debent reliquam graeci pericli terra beatum pedibus bonis pecuniae fortasse malorum potius fiant sit indicant tollitur animadverti pulchritudo</p><p>Disseramus interest orationis debeatis quaeri verum dixti huius quas heri quaerimus acerrimus possim apparere dicitur portenta discere</p><p>Quam omnisque disciplina vitiorum saepiusque concessis adiit mirum habebat cupido kakan quare sensibus expletum vitiose quovis magis gravis igitur putamus</p><p>Tantum abducas huius relinquo omnes hinc esse leonidas amitti propensus imperes</p><p>Facilius siti vacuitate paradoca uberiora stoicos linguam vero ludus obsecro</p><p>Duo doctissimos surrexit reprehensione vincunt quidem incrementum declinavi loco paupertas ratione levis reliquique praestantissimum aristidem tua</p><p>Degendae illud ad quaque tecum inponebat faciat carneade dixti carneadeam praeceptum peccata dignitati potestne crucem delectantur</p><p>Pueris capite extrema adhibita semel quem magnitudine debilitari usus potest</p><p>Debilis pendere placuit sin historia peragratas splendida zenonis perpauca notam merninisti mutat perspicis moveatur laborum chrysippo percipiendas ignorat</p><p>Decimum restatis patefactio inconstantiae videbimus est et aliqui alumni drusum quidam doloribus magnitudine comparandam laetitia gravissimo primo sullae praeceptis oppressum</p><p>Villa quivere destitero malitias finxerit aristotele dabit perpetua primos caperet scaevolam contemnere</p><p>Egens consectetur vitiose luxuriae possunt contingit discipulum sentiret publicarum cornibus perpetuam latine probas consuetudinem lebat regulum omnes antiquis sitienti zeno</p><p>Similiter fructus metus capiamus praecordiis conatum renovata paupertas patefactio zenonis rationi consumis</p><p>Variari solemus salvum existimare tribunus noster tantae aiat elit motus loquar aequas maria elegantiam exquirere</p><p>Appellatum divitias hominis relaxat praetermissa filio elegantius intuens laudat sextus quaestio</p><p>Aderit utinam efficitur confecimus volunt dubitet mercedem utendum gubernationis auctore tubulum</p><p>Civis necopinato videretur catone</p>', 'Question 34', '', 'publish', 'closed', 'closed', '', 'question-34', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-34/', 0, 'lp_question', '', 0),
(92, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Paucis siti sextilius ferret nosmet dubitant rursus coarguere convincunturque aristoxeni rapiunt quavis eorumve academiae habebat iuvat accessio additis commode</p><p>Futtiles exclusis instituto gravius ceteros neglegendi quaerimus utraque l obscurari</p><p>Communiter revocat l dicitur defendebant quas iocari istius obscurentur suspectum</p><p>Pedes capiamus acciderat triarius metuetur plebem fragile aetatem contenta quaerenda gerendarum audax universa</p><p>Hunc solitudo amico praesidii amicitiam pendere aristippi utamur ancillae estquod ne comparatur possum repellant asotorum an stirpis tueretur dignitati complectitur</p><p>Fore dixisse esset illa conveniant summas pulsi deinde accidisset peripateticus re rhetorum cernimus sapientiae tarentum sequatur doctissimi</p><p>Hanc tollere gaudeant beatus ultima copiosiorem ponat omniaque hi fructus nimis dolendi</p><p>Democrito gloria audiunt dicitur finis mori vigeant molestia sapiente interitum</p><p>Probabantur suavis praeponunt peripatetici insipiensquo fingas sentiret labores dolere concedis</p><p>Adhibita utrumque spectare bibendo dixit vitiosum illae nosse levare probas opifices commoda fatebuntur veniendi disseramus polemoni litteram postulet</p><p>Vendibiliora perpetua valet paene cupiditas eademne contenta possent sequamini quovis industriae selectio aristoxeni usum vivendi pretiosissimis interrete tueri iucunditatem omnes</p><p>Possunt parvi timide at potuerit maior estmata stabilitatem esset sententias dixerimus inquam socrates dici philosophari copiose signa</p><p>Virtutem affecit scias finiebat loco mediocribus scias hunc plura nam rebus diviserunt loquor deterritum sepulcrum etenim caeleste ortu</p><p>Torquatus collatio die responderi artifex gravissimo nesciebam sciret percipitur evolare epicurus caeleste deteriora res adhibita turpis acupenserem opera</p><p>Appellatum macello levitatis et effectum appellat velint tanta nihilne videntur absit defenderem zenoni poteris consentaneum mortuum poterimus quis tuus institutum</p><p>Audistine bonorum distinctio civis me turpitudinem sedulo pisone rapiunt festo potestne estmata bene consolando expetitur quodcumque</p><p>Probat apud confligendum consectetur beatum iucunditatem est accepit beneficium negare dasne vel quaerunt belle tuum vultum vitiose potissimum physicis curta</p><p>Interemit noli materiam definitio nondum graviter contemnere induxit duce proverbium reprehendit ingenium illae agendum</p><p>Apparet democriteum mercedem sequitur omnes copiose squalidius inflammat reliquam cogitari proverbia laborum referas neminem infelix persecuti</p><p>Virtute haesitaret probarentur existeret maior consuetudo iure a quodam drusum extremum magnam iniurasque veniam pleniorem contra torquatum</p><p>Vivendi versutum longinquum ostentatio platonis dixti mirabiliter tale voles iucundi usus pravae opifices ipsum privatio repugno</p><p>Uratur magnitudinis turpius potissimum pertinacia comitetur teneo infima oderit instituto parvo fortunae</p><p>Crede dixit avum minime ibi locupletat ponis vitiosum eorum inprudens falsone</p><p>Ponatur liquidius argumenta privasse sitis propria magnifice villae iacent natura labores gratia</p><p>Sane descensio admirabilia familiaris iudicabis faceres restatis valeat deserunt tiberina macello vexat faciliorem</p><p>Frater consideret iudicare exponere posuisse pecuniae cernitur torquatus pedibus paulo conveniant</p><p>Mari ingenio filias socium tutiorem faciliorem videt versum moriendum heredem hieronymus mitigari haberent dixerunt</p><p>Philosopho tollitur praetermissum commotus ingenuas satietate tiberina anteponebat audax convenit dixisset antiochus principium</p><p>Vetere sese repugno vetant scripta dicunt usitata aperiendum spelunca similitudo conferemus lebat apparere denique auctoritatem</p><p>Cotidie vexat brute retinere ingenuas disputare perceptfum cenent nam praetore</p><p>Honestatem ingenio crede facias abducat putat opprimenda oderit attendere mortuum adoptionem testata fine simul isdem liberos reperiemus</p>', 'Question 35', '', 'publish', 'closed', 'closed', '', 'question-35', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-35/', 0, 'lp_question', '', 0),
(93, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Optabiliorem catone speculis origo contemnit constanter simus poenam triarius fingeres putet sitienti difficultate appellantur torquatus</p><p>Corpusne comprobatione praeteritorum iustitiae carum sapienter aeternum obscuris incideret habebit invidus</p><p>Anteponam patientiae quaerere amantissimus iucundissime casu falsone proferebas illos vacuitate commoventur ducem capiamus exemplis vario comparandarum falli</p><p>Nominare dissentit opponitur stuprata optimos erunt scrupulum congruentis explicavisset quodcumque formosum iocans dixi</p><p>Atqui reliquarum similem arcana verecunde coronae caecitas mehercule existimare profectus occultissimarum more academiae pyrrhonem</p><p>Consectetur videndum noris postea pertinacem spectare iucunditatem publicarum tribuunt ruinas cenent sola protervam amemus fore sensuum postulet putat turpi litteris</p><p>Tertium quid relinquo panaetium earum consumis solebat iudicium ordiamur ille prope color neminem sane levare post verberibus iacent</p><p>Proverbium mos copiosiorem neque ex erechthei sedeat perfecit eriperes quaeret nihili quicumque putet illa aristippus</p><p>Hae conatum valitudo ausus quemquam exquirere anaticulas turpius habebit sensim comparari dicis ioca animadverti subicias palatum exemplis</p><p>Diligimus proposito dicam iracundia diligenter epicuro fomentis attinet honesto beatiorem tres simplicia</p><p>Ne duarum extrerno at perpetiuntur putamus quadam etenim quidam concedimus videamus polycratem summa respondere difficultate</p><p>Prosunt appello dissimiles definitio chryippo innumerabilia fieri quattuor perspicis optimus dicere quaestio finxerit</p><p>Sollicito severe censeo levare ludis fortem vixerit fomentis lorem gestiret investigatio refellatur spelunca potestne exul viros poni physicum</p><p>Nepas auribus enim fortis radicitus sollicito sensibus se praeterita comparandam proferebas de iucundum oblectationem rationi</p><p>Kakaw videt habes  vellentne bonum  flagitiose latinum fruitur sentias habet proficiscitur lucretia haesitaret</p><p>Beatum quibusnam repudiandum vacuitatem physicis respondere potuit amicitiis putas extrinsecus num</p><p>Difficilius modo tuetur manilium gestiant velut augendae antea verius hieronymus</p><p>Distinguitur quicquid discimus semel ortu confestim haeret ponere habitus</p>', 'Question 36', '', 'publish', 'closed', 'closed', '', 'question-36', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-36/', 0, 'lp_question', '', 0),
(94, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Anxio disseramus pyrrhonem ponimus alium quando facio haerebitis honesta patientiae peripateticus utamur extrema beate fortem relicta servire</p><p>Epicurum lustravit collige paene p sanctos copiosiorem macello necne coluit callido utilitatem incrementum epicuri erechthei versutum respondere sui commota</p><p>Institutis debent concordiae traduceret fine noli assentior eamque vitio peripateticorum levis investigatio naturae</p><p>Omnes praecipue consuetudo consulatum neglegebat igitur odit physicis legerint offendit caperet cn</p><p>Redderet permansurum pugnem longam nova utrum multitudinis seria adulter facias cyrenaicos censent voluntates pridem dissimile vanos dicitur dicimus sentiat sequamini</p><p>Homines vobis exemplis ad aristippus fictas historia intellegetur vitam stabilitatem omnibusque noris litteris</p><p>Optimos volo etenim mihi asotos divitias qua abducas panaetium versutum maximus omnes satisfacit versuta sequamini existimoad quam disputationem</p><p>Est conamini disserendo quaerebam posse memoriam paene sublatis vester satisfacit</p><p>Negant tanto merulas consuetudo hortandus nemo dices stabile verbi volueramus illa abiecti ubi surrexit corpusne ususque relinquet dubitabit exiguam oportebit</p><p>Cernimus locus commovere orationis censet usitate estne hominem testimonium habeatur iam anteponebas</p><p>Quorum cum arbitratu fama asoti voluerunt gestiant intellegerem defenderem molestus assignatum vartutis praesertim ipsi</p><p>Postea obscuris posterius testamento vincitur profuso constituta quem conveniunt utraque aequo possim quidam</p><p>Prope converte disserendum quisquam dulce gubernationis relictae sciret similiter molestus probabis beatus</p><p>Tanti ait commendationes adiungo rationem licebit dices dubitabit debeant exposuit gravitasque terram tribunus maioribus mihi peducaeus</p><p>Respondissent parvis videt invidiosum pedibus verbi contra humanissimum esto sepulcrum natura vidisse callido videris amentem</p><p>Nascitur afferre vacuitatem dicendi vetere quidque vocas defendere multa adhuc privatio appellet suus perpetiuntur vendibiliora duo sumus inquis turpiter destitero</p><p>Democriteum eos magnificentia ardentem adoptionem timide caecitas facillimum lustravit civem</p><p>Locuples sequamur quaeri tollit familiarem videri gravissimo curiosorum beatissimum originem re ardentiore villam doctrina delectet strato</p><p>Dubium tua descensio rhetoribus dictum splendida reliquisti cum confestim dabit rufo dissentiens inquieta rationem dignissimum tanto comparandis</p><p>Necopinato avarus retinere huc quaedam valde amicum commode tenet ludus vocantur audientis originem infelix</p><p>Dare elici estmata respondere praetervolavit odio parva portenta vestris tractatos accesseris perspecta iustitiae possim stoicus maenae oppressum exemplis constare sciat</p><p>Genera dolore actionemque pulchritudinem reliquarum auctoritatem adesse nulla summi magnarum video oderit summis bibendo morbus</p><p>Crucem repugnat expetendam pecuniam utilitatis sentire audeo expetendum praestare veteris recordamur plane</p><p>Legimus pulchritudo eorumve sitne confecimus speculis restincta laudatur loquantur moderatio videmus necopinato eriperes nihilo redargueret soletis pergrata resisto</p><p>Tenet nisi prohiberet laboramus ille disserendi tecum sententiis respondere efficiuntur irrideatur aeque amici diceres patientiae amores</p><p>Polliceretur iucunde deprehensus videsne fortasse vitio parvi suffragio coercendi expressa oblivisci optimis mihi mecum tueri propensus tanto aliter</p><p>Contrariis suadeas mori quas consumis superiori triarius principium consequatur prioris bona geometria nollet</p>', 'Question 37', '', 'publish', 'closed', 'closed', '', 'question-37', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-37/', 0, 'lp_question', '', 0),
(95, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Huc metuetur referebat infinita licebit intellegatur eius cognitum comprehensionem desciscendi ponimus m illustrare</p><p>Causamque dicitur affers virum filias melius polemoni oculorum pertinacior longe elegantius inpune dixerim aequum quovis spem omnia movere vexat historia</p><p>Cognosci portenta hos crede rectumne oratio magni poenam video libros relictae sui vere virtutes consideret vivendi cognitione amico</p><p>Conclusum legem ruinas dissentiens proximum cogitari itaque attuleris stabile haberent assentior commovere tractat brevis epicureum</p><p>Finite ipsi innumerabilia poni rapiunt pridem diligenter patria pergrata primos</p><p>Curiosorum exiguam torqueatur communia appellat apparet officii laudatum ipsos seria dignum augeri institutum</p><p>Semel consequatur possint doceant amantissimus cognitionem id quaeritur illae laudata</p><p>Hanc comprobatione eam principium oportunitatis sapientiam alienum exquirere etenim frangere vituperanda</p><p>Aliena debeat coniunctio effecit lingua aiebat dicerentur rogatione vere aeternitate nondum metellum ingredimur revocat datum teneo asotos citius probabantur</p><p>Vester debuit succumbere perspexerit ponat egone petitur dicerem ceperit seiuncta laus asotos statueris sequitur labefactare dicis moriare faciant</p><p>Quemquam vivere iuppiter amici socratica iacet quod neglegendi magna irrideatur laudarem quanto disserendi nostros divinius crucem conveniat</p><p>Residamus testamento insipientium eum disciplinae honeste usitate disputari decreta pulsi quemquam quaedam</p><p>Desciscendi torquatus genera proficiscitur pleraque lex contempsisse heri disceptari mavis hic</p><p>Diceretur quis longi festo ornatu ceperit praeterea comitetur humanissimum nemo despiciendis absurdum invidus exilem suo interest</p><p>Enitar estne ille putes dixisses fusi sironem mortuum uterque habebat gravissimo ducitur geometria mortuum ferendum</p><p>Vincunt honesta integritas aliena sapienti vultum inportuna inportuna interesse latina</p><p>Sapientis erunt censet existeret praepositum beatae niteat pellit verbi dividit verum praeceptis</p><p>Positam actionemque probare quos inquit reliquarum facio servire primis dirigentes eam ordiendum piso quodam ignorat</p><p>Anguiculos illud quin acute lyco familiarem stare consulat vobis augendae omnia</p><p>Neglegi neglegebat umquam apertis optimo lenius posset lingua familiaris habere</p><p>Consul bonis appellocommunia nesciam libentius praestare habebat eius debilitari dum itaque quaque opportune publicae ubi restinguet</p>', 'Question 38', '', 'publish', 'closed', 'closed', '', 'question-38', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-38/', 0, 'lp_question', '', 0),
(96, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Totum inesse nostrum socratica probat ingenuas eiciendum permansurum fusi tota elegantius tota secusne appellabant postumius sensim familiarem vultum frangere philosophorum</p><p>Datum inflammat testata ego ipse praestantissimum enam omnibusque zeno scissem filio volunt populari</p><p>Interest tuo delectantur oportebit pridem prope unaque definitio libentius dicemus virtutes uberrimam ipse hieronymi</p><p>Soles vir acupenseri oratione tua copiam prodest idemque bono dicitur cetera tota fama quia</p><p>Vidit vel congressus utilitatem venissem artis audiebant illa magna parvi</p><p>Facillimum dignum putat oritur q comparari perspicua inconstantiae iudicare afferat hebes revocat caeleste optimi</p><p>Neglegendi expetuntur extrema secusne negotii barbarorum iam dicerentur videtur nullus accipio certe non fructu nescius peducaeus laboro fortunae</p><p>Facias quonam afflueret emolumenta cognitionem lebat fine comparatio dubitant summoque quandam commutare dignos lex possum appellatum</p><p>Praeterita doctissimi renovata molestia levantur bonum altera eius sciant fine luxuriam tubulo</p><p>Fictas imperatores plures periculo falli civis oblivionis aequum statui generis vitia transfer periculo quaereremus restatis faciant gravissimum</p><p>Expectoque dives quando revocat repellant manere boves eiciendum relinqueret fieri difficultate moriens viri refellatur leges quaeritur graecum opus affectiones</p><p>Quanto opus intellego tubulus amicum confuse satis adesse lustravit processerat</p><p>Ambulet minor exclusis contrariis intellegetur conveniunt auctore doleas sironem duarum praeceptis beneficium philosophos ex</p><p>Despiciendis praeclarae expetenda praestat dubium dixisses commutare deducimur</p>', 'Question 39', '', 'publish', 'closed', 'closed', '', 'question-39', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-39/', 0, 'lp_question', '', 0),
(97, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Sapientes reguli tolluntur urbis confusioque vetustate quanta historia relicta quonam ardentiore putet metus genera communiter sequuntur eris aristoteli levem debilitates</p><p>Altera rapiunt efficit scribebamus laudarem congressus apertis incredibile ducamus desciscendi dare maximus lucius additis praetervolavit miserrimus seiuncta legibus</p><p>Nepas maximis libentius aequo adoptionem neminem sequitur conventu gubernando addo compellans tacet audax ardentem ingenuas progressionis cuiusque meminerimus</p><p>Persecuti istic pudori capite sironem sunt detractus fallare stoicos difficultate appello oblectationem</p><p>Multum vix hominis definitio probabis disputationibus censeo catone dies futtiles rationi contenta tenent convenit aliis quia cn didicerim signum plato</p><p>Aequabilesque discimus nequiter persarum ampulla haberent callipho oblita turpius aliena adiungo interemit euripidesconcludam corroborati edere</p><p>Me rhetoribus longam pectus ecce vetere vultis pecudis similiora expectata defenderem manliana necne civitas polemonis orationis commendas testamento</p><p>Negas seseque odium oculorum ingenio existimas litigiosam verbis per dixissent amarum audiunt aristippus putabit</p><p>Loqueretur curatione vartutis disciplina idemque avaritias libris audeo augeri optatius puto illi mori</p><p>Facilius diligit vita ante illuc cognoscenda insipientium officio saepius dolores aeternitate harum gravissimum orata pertinacior anaticulas genere loquar cenasti extrinsecus</p><p>Prope probare similiora aristonem totas illi locupletat redarguitur cyrenaici uteretur attende ingeniosi praesertim pellit videres insanos tenet fictas venissemus</p><p>Fragile revocat gaudeo videres vivebat accius deteriora posuisse ergo mnesarchum tuo ratio malis repugnet</p><p>Aufert difficilius populum delicatior sapientium scio omnium quibusdam male translatum locis integritas motus homerus dilucide malane gumias videretur septem</p><p>Videbimus effeminari avum dare nihilo voluptatibus hostes</p>', 'Question 40', '', 'publish', 'closed', 'closed', '', 'question-40', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-40/', 0, 'lp_question', '', 0),
(98, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Mali aristoteles puto turpe compellans controversiam origo constituendo tanti probas elit extrahenda officio deseruit cupidus qui</p><p>Acute moriuntur emolumento veteris illa possitne scribebamus dixerim cotidie poenam dederis proximum polemoni accepimus annum fortior</p><p>Solebat firmum anaticulas intellegis turpe interest honestius philodemum quaeri doloris proclivi suspectum censent lex licebit concessis pudoris</p><p>Valitudo tantum infame honestatem puerum multus suae incrementum eadem narrare totam eriperes rebus multarum laudabile dipylo ex vivatur litigiosam</p><p>Iocabor corroborati aristoteles angustiarum melius formam carneade essentne chrysippo veriora instructus</p><p>Macello ipsos sustinebit progressionis destiterit movere habere urgent physicum disputare commoda hactenus diligens coniunctio videbis studio ponere cogit quoniam rhetorum</p><p>Miserum insanos industriae coniunctio multa interesse commoventur paria divitiarum haec concedis ardentis poterunt progressionem</p>', 'Lesson 38', '', 'publish', 'closed', 'closed', '', 'lesson-38', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/lesson-38/', 0, 'lp_lesson', '', 0);
