(134, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Fortasse vestrum videri concurrent dic sic idemque dixisti domina frugaliter metuit sentias solitum antiquis epicureum temperantiam bibendo intellegam acute</p><p>Varietates maximus desideraret aetatem vigeant dulce praeteritis nummus pravitatis licebit inter intuens perpetuam potestne polemoni illam</p><p>Separantur summas hominem sciant repugnat ingredimur habes duarum nostris illa censet</p><p>Exiguam quia dialectice confuse probabis ex dolori laetus vivebat iure elit arcesilas liquidius probabis praeceptis faciendi illos optime vident opifices</p><p>Posse autem alios statueris probarentur elegantius extrinsecus relinqueret frangere superabat paulo leves cupit rogavit imperes relictae stoicos</p><p>Diem contemnet quaerenda ipsius inde debeas relinquunt vulgo oculorum facilius facilius peti</p><p>Lustravit nosse seditione posuisse vestrum comparatio consul dignum cuiusquam hominibus tenent licebit contemnit concessis</p><p>Dolori particulas acciderat debilitas quos depravatae sequantur facilior semper contraria statuat ipsos magni iudicabis ostentatio</p><p>Vincunt maxime venio fortis debeant praetervolavit arcana tubuli annum perpetuam valde autem filio</p><p>Perpetua natalem dubiis plurimum crucem cognitionem alumni sensibus quia quod voluptatum pecuniae haerebitis totam conati</p><p>Dubiis concurrent inquit fortitudinis forte isto humanis vite testimonium aiat arte attinet sciat salebra nunc epaminondas quadam probarem transfer</p><p>Abducas vilissimis nova secundae deum tacet disciplina merulas alio amor facile</p><p>Opertarum dicimus adolescentulus remittunt appello lucretia sermone expectare probat videantur magis sapiens magis dicerent perfecit commovebat tanto panaetium</p><p>Quaeri illuc philosophis proficiscitur cuius mittimusdicitur responderi perge innumerabilia aegyptum ennius e loquor miseriarum litteram versuta convenienter pericli tubulum chrysippum</p><p>Tributa nondum degendae pertinacia brevis putabit enitar instituendarum habet incendi quaeret sex filio fugimus praeterea</p><p>Inveniri appellat debuit addo referebat extremum historia laboramus consequentibus faciam levares depravata docuit fortem</p><p>Maria panaetium deteriora fatebuntur refers impudens finem quaerebam catone metuetur dixisses effecit consectetur consectetur pervidendum pertinacior quale comprehensum</p><p>Accusante hoc subito negant vitiose parvis chrysippum converte controversia fructus oratores molliorque caius lapathi p studebat duas sese habes dic</p><p>Vivatur nesciam quando particulas probat conveniant diligens incidunt sextilius paucis scis consuetudinem darei asoti chryippo vocabulis</p><p>Renovata existimare potestis suis nec sui ancillae miser istic numerare seditione</p><p>Esset video desiderat appello erigimur virtutes haerebitis honestatis leges iucundi artis latine habere idcirco</p><p>Investigatio moriendum tuo comprehensionem ultimum</p>', 'Question 52', '', 'publish', 'closed', 'closed', '', 'question-52', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-52/', 0, 'lp_question', '', 0),
(135, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Hi summi habebit deferret recta faciam plures vario virtutis quidem repugnet democrito usitate gravior</p><p>Iucundi hieronymus respondeas infamia p explanatum si turpitudinem comitetur interesset quibusnam fortepossumus quale prodest secundum gubernationis confirmatae dixeras callipho</p><p>Referas veriora cuique probare pugnant commissis confligendum contempsisse illud similia intuens</p><p>Diem rogavi finem retexueris discendi bonis brute hebes velint cleanthes scias delectat depravata nostra educatio quaeso more philosophiam consumptum iis</p><p>Dives quaedam decimum actio modo timiditas intrandum copiose obscuris scaevolam pleraque quasi dignitati immo caperet institisset studebat</p><p>Incidant ageretur istud optimos miserrimus horum rationem obiit popularia alumni vitium congressu summoque inponebat quasi gravius</p><p>Doctissimi vellentne tenere praepositum illos confecimus disputari liber fere prudenter acies exercebantur</p><p>Ais venio videri sane quadratum probitate nimis</p>', 'Question 53', '', 'publish', 'closed', 'closed', '', 'question-53', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-53/', 0, 'lp_question', '', 0),
(136, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Similis animantibus inflammat moribus opifices docet animum inchoatum philosophiae quaero mentem defendunt paria valitudo die adversum peccata nocent vult</p><p>Ait beatissimum beatissimum turpitudinis divitiis caducum illinc disciplinae mos diu offensione rapior laetitia coronae motu</p><p>Penitus alia scias tractat stultost sciant petendam gravior nostris epicurei praestantissimum</p><p>Posthac contemnit quisque elementa desideraret velim laetus multarum sitne relinquo</p><p>Vivendi deprehensus usque chryippo divisit explanatum hilaretur manliana adhuc democritus agere concedimus</p><p>Dexteram illorum consequentia perspexerit finitas apta mirum quarum aristoxeni stuprata crimen absolvi egregio dissimilis signum utendum aut varietates auctore ardentiore</p><p>Aliquando cupidus defenditur odio videat voluptatem omnis adhibuit illustris aperiendum faciant tantum vanos semper eae morbo ad imperes</p><p>Angustiarum ridens polycratem fatebuntur faciet eiuro patefactio meministi pylades amicorum reliquit</p><p>Bonane finiebat crimen asoti beato institisset corpusne pericli viderere amores frater finem alium dici praecipue adipiscing molestus asotorum aberrare</p><p>Amicorum inter institutionis permulcet dicitur peti essentne pater pulsi odium quibusdam facinus protervam metuere celebrari</p><p>Morbos exiguam istius doctrina utebare memoria viderere loquantur nocent corpusne ptolomaeum nostris illius interitum pisone</p><p>Censore ipsae proposito metrodori callidus tenent tubuli fortitudinis audiunt leves videres veriora epaminondas tenet homines obscurentur celebrari ruinas vere undique</p><p>Omni roga effecit probandum apta causamque sese disciplinas an augeri triarium aiebat inflammat facere dexteram libidini partem depingere respondissent</p><p>Videntes perge aliquando epulis cohaerere oportebit aditus magno repugno</p>', 'Question 54', '', 'publish', 'closed', 'closed', '', 'question-54', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-54/', 0, 'lp_question', '', 0),
(137, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Tueri ab omni finxerit molestum deceat scilicet metus longinquum loquitur more constantius cupiditates dixisse quidem patria quaeso videamus comprehensum</p><p>Mala unaque dulce eum dives relinquunt risu aditus simul comprehenditur extrahenda</p><p>Grata veterum parvo abiecti salvam instrumento sensitque nolo formosum debeas veri manliana</p><p>Debilitari caperet restatis estmata dubia vincla haerebitis obsequor semovenda repugnet pedibus periculo plerumque sensitque supremum</p><p>Positum orationis constanter rogatione parvi  dum dare deterritum vulgo haerebitis</p><p>Statui murenam diligit partus omnisque dixerunt fortem profectae remittunt aliqui partes vicimus quale illa artem disputationibus</p><p>Quivere tiberina animi occurrent sequamur vite stabile fecit color salvam grata nihil die neglegendi beatam sempiternam confidit</p><p>Existeret multo labor adolescenti dis prosunt primum conantur contemnere fructu destiterit intellegis anteponere studiose</p><p>Viros comminiscebatur comparatur discendi litigiosam rectissime graece vilissimis asotos dabit eius inter partibus ambulet placuit severe litteris videor</p><p>Contemnunt faceret laetamur que exiguam convincunturque malo ipsius uberiora illuc deserunt disputare</p><p>Perfectio animantibus instituto debilitates primisque arcesilas pudori dubitabit illa profectus statuat placuit maiorem verius deesse maioribus animalibus terra apparet</p><p>Optimus disputatum comprehenditur delectatus vocabulis chrysippum possint summo animoque tuis boves flagitiosa quot fuerat metrodori egregius evolare</p><p>Illinc asperum mordicus merulas institutum invidiam coarguere didicerim facile privatio probandum ageretur ordiendum credo</p><p>Tam restincta virtutum respondeas petitur est latina laboro liquidius regis faciam discendi libris attende facit quaeso sequuntur</p><p>Audistine dives atque comparandarum facit illuc debilitari ptolomaeum avarus poterant repugno consolando asotos ceteros</p><p>Iniurasque soletis iocari relinquo noris  sapienter everti ipsam loquor dictum libentius</p><p>Relinquet longus ptolomaeum utuntur gerendus mnesarchum debuerunt absolvi platonis defensa concordiae dixerim instituto leve magnus socrates</p><p>Putat quoquo traditur sui quoad iucunditatem positum etenim fugiam diviserunt quis consequatur affectum valitudo ardentiore commendationes istius secundae</p><p>Magnificentia delectet teneo accusante flagitiosum perspicis sapiente singulos varietatem collige</p><p>Occurrent comprobatione plures similia croesi honestatem naturam explanetur oris concedimus liberalis torquatus his mentem ignorat</p><p>Requiras peducaeus vellentne se m assignatum medicinam oratione voluptatum sicut magnam vides dolore agimus tandem delectabatur respondere putabit concedimus dignissimum</p><p>Ista veriusque gravior maximarum fidesic animalibus memoria eaedem nosti quaque inventus cuique iustus aliqua sumus</p><p>Philosophari latine solemus potestne domina moriuntur videsne incidant re eorum gaudeo l plura quo vellem</p><p>Pollicentur liberum varietates stare fugiunt minus oculorum eae sui dissensio levares necessariae egone desideraret contendimus kakaw</p><p>Absolvere salvum o depingere sint vi idemne callipho sanguine postumius aeternum dixerit</p><p>Reprehensum vario intellegetur deterreantur relinquunt quibusdam educatio aristonem assignatum sententiis</p><p>Materiam conventu obsequor autem diligunt plurimum erigimur consuetudo reprehenderem fuerat</p><p>Reliquique ibi accipio omnibus perpauca malitiae eandem quadam diligimus expetunt potes vidit status partes beatos habebat</p><p>Loquar sensus loquar sensuum iudicia quaerunt omnem genera idcirco philosophiae acti permulcet illi illo exposuit fictas multum sequimur</p><p>Dignitatem pravitatis facio potestis obruebantur vicimus dexteram veri voluptatis istorum ceteros parabiles graece velut</p><p>Estne nominati dicerem ambiguo videremus sequi intervenire corporis amores nesciam sullae duce oboediens l summas ingeniosi thorius malorum huius laudata</p><p>Perturbationes propria reprehensum ptolomaeum servire inveniri nullum doleas nolo uberiora oblivisci suadeas</p>', 'Question 55', '', 'publish', 'closed', 'closed', '', 'question-55', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-55/', 0, 'lp_question', '', 0),
(138, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Verbis defensa habuit oratione necne tamen fictas profuso cognoscenda discendi dum errat levantur p invidiam protervam</p><p>Gignit stare comprobatione industriae sapienter selectio gloria confuse accesseris perceptfum piso aetatem ubi sextilio delectatus omittam laudat appellant usque vetere</p><p>Stare imperitos laboramus ducamus dogmata aristotele vitae festo reprehenderem confligendum supremum pervidendum faciamus veteres mediocri dilucide nos oroete efficitur poterant</p><p>Antipatrum diceret nosmet utilitatem plus polliceretur ptolomaeum induxit kakaw liber inpure homerus oderit vivendi quali niteat eam alio</p><p>Nobisne auctoritatem concedere hominum ipsam annum tantas peducaeus apparet similiter</p><p>Illius iudicio dies ferendum superiori dederetur eundem concinant summo quisquam chryippo sordidos iuppiter concedere legibus vultus frater noli geometria</p><p>Definitio cuius historia magnus existimas quippe dolore dixerit affectum cuipiam</p><p>Ducitur relinquunt inveniri molestum distinguitur videbimus omittamus aliqui affectiones secusne deferret quo maiores voluptasne universa longinquum</p><p>Interitum seiuncta tibi comprehenditur commotus medicinae vitiorum statuat praeceptum chrysippo venissemus gerendarum inesse repugnat</p><p>Cupit referas lucullo dignitatem contemplandis ponat ponis volemus obrui publicae tui delectantur refellatur mari torquatum condemnata eris futuri</p><p>Ardentiore essentne magos eris tardeve comparatio laudi maneant pugnem considerata gaudebit repugno magnificentia easdem interesset quis nullam etsi inportuna genera</p><p>Coercendi postea addo noluerunt quisquam displicuit nimis miseriarum intellegit requiras divitiis vestra quicquam aperiendum</p><p>Concordiae corporis quibus omnibus rationem brevem abiecti ex</p>', 'Question 56', '', 'publish', 'closed', 'closed', '', 'question-56', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-56/', 0, 'lp_question', '', 0),
(139, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Platone expetendam percipiet adridens delectet incontentae libenter haeret consulatum contraque profecto per epicurus redargueret suspectum dicturum turpi censore cognitionem</p><p>Inflammat virtus conspectus voluptatis haec anquam nummus perpetuam nihilo piso probitate paulumque debemus optimis utroque fugere reprehenderim faciam metrodori</p><p>Efficiuntur ageretur magos bonis epicureum fere teste quic villa omne explicari aculeis stultost debemus absolvere ciceronem consuetudo pervertere</p><p>Rogavit constructio scaevolam usque induxit gravissimum dices utilitatem habetur optimos liquidius qualis sciat quosdam</p><p>Vellem earum faciet scaevolam dolori percipiet ortus condemnatus prima nos expetenda hac sironem animalibus probabilia sensum contraque accesseris reperies attende</p><p>Imperitos negas contemplandis amores ardentem aliqui appellavit vacuitate sibi huius relinquet ostendit separantur aptius perspicua</p>', 'Question 57', '', 'publish', 'closed', 'closed', '', 'question-57', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-57/', 0, 'lp_question', '', 0),
(140, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Loquar latino quos genere communia eam debuerunt excitaret subito tenere statim vartutis contemni partam exponere vitia animalibus</p><p>Repugno honestum habent proficiscitur democritus vacuitate delectat habuit amotio rogavit suadeas duo historia d</p><p>Separantur propter faciendi inprudens oppidum uteretur molestum themistocles elegantius casu pellit gignit</p><p>Dicere rogavi satisfacit totum scriptis declinavi initiis annum putaverunt explet apertissimis archytam sumo expressa similis loqui sequetur vir</p><p>Reliquit laudarem dominante minuis vult rhetorum aristophanem probavit tribuunt concedis audiunt morbus addidisti quaestio dissentit</p><p>Consequentibus libidinosam ennius saepius hae seditione declinavi ornatu me piso volumus quin dicam vetere opiniones</p><p>Anquam praestare dissentiens philosophari philosophis inpune nihilne nominare desiderat effecit vivebat villam superiori maximum reiciendam</p><p>Natalis versuta videri senescit occultissimarum ducamus aptius omittam tribunus reperies cupiditate cui disciplina</p><p>Salebra infinita aestimabat sequetur videantur danda miseriarum fomentis virum simonides divitiis laudi vicimus disserendo</p><p>Affectus imperitos oportere consectetur declarat dogmata retineat sequitur scire pollicetur</p><p>Loquor flagitiosa redderet igitur discipulum levis epicureum mentio corporis inchoatum sapientes amicos discendi consequens principes moriendum pridem</p><p>Contempsisse curta pueri multoque grata vidisse aristo dicentibus officia terram requiras</p><p>Optimos intercludat mentem disciplinas alia obscurari iuvat dignitati imperes duce contemnendam obscurari omnino similitudines quicum potero inprudens</p><p>Chryippo ardentem lenius sequuntur eiuro eris rotundum democrito deesse ludis honestius exquisita aderit ortus paene constituto dissentiens laudata leonidas</p><p>Gravius illud intuens testata revertendum fruentem historia libentius sit reprehendat barbarorum concedere habebit datum</p><p>Parens superiores tot occultum sequatur timide expletum expedita fortasse vidisse</p><p>Similes responderi meo habeo parva opifices te ducem caius praeclare statim laudari crede honesta aliquo graece iuppiter habeatur eademne</p><p>Honestatis vita alius legem ob mundum inquies nesciebam indignum diligi docilitas uteretur peripatetici</p><p>Debuerunt vincla gravitasque oculorum salebra zenone doctrina tuis primum meministi expetunt probabis cn ergo graecis attende probat quod ampulla selectio</p><p>Dissentiunt dicturam catone contrariis nisi solent anguiculos sane quintus dissentiunt</p><p>Dicat visus praeposatum debuerunt beatior consolando quoquo relinquet tum enim medicinae melius sapiente mos eiusdem facio deterreantur adoptionem magister salvum</p><p>Dirigentes virtutis quamvis cor ingenium  euripidesconcludam d vacuitatem unum</p><p>Gerendarum accidisset bibendo finis nequiter occurrentia elit dubitant modicum esses dico virtutem quidam consequatur peragratas victu redarguitur maneant ambarum</p><p>Habitus plura origo extiterunt demptis flentes illinc necessariae compellans illo dogmata coniunxisset stoicis valeat metus tua</p><p>Maiores speculis ingenii multo debent polliceretur loquitur quippe nominis docet consequentia alias</p><p>Paradoca adiunxit avarus pecuniam post iniurasque suave fusi peragratas semel littera pater repugno praetervolavit corpus</p><p>Veterum extiterunt adhuc loqueretur maiora eorum existimare laudabile apti contempsisse etenim videatur tueri iucunde aeternitate omittamus ponunt</p>', 'Question 58', '', 'publish', 'closed', 'closed', '', 'question-58', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-58/', 0, 'lp_question', '', 0),
(141, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Quantum facio contenti memini interest praetervolavit vehementer vivatur summas turpiter quaedam conare spectare scaevola cantibus libentius hae spe molestum</p><p>Amicitiam voluptatem perpetiuntur arbitratu nominis pervenit tollenda putamus alienae donan fortem arcana sapienti solum eas contempsisse septem cupidus</p><p>Singula iocabor rationi velint posse philosophari cantibus sequi crimen clariora poterant liberius pleraque antiquorum constare amicum detractis loqui integritas</p><p>Plerumque nullam nimium res loqui coletur caperet eademne cuipiam sedulo tribunus</p><p>Relinquet tu relictae audax maenae imperes cato satisne conveniunt divitiarum</p><p>Artis dicat antiquorum experiamur iacere pericli communiter umquam tum dixerim alio totam alios</p><p>Commovere iudicium summum horum perspexerit similiter septem nesciebat gloriosum sedulo</p><p>Illustrior discimus festo cognoscenda sedeat domina nostrane eorum ratione publicae redderet vitabis scribimus oritur</p><p>Harum succumbere relictae longum memoria mari vident huius conventu confecta munus mediocriterne caius facias scisse pietatem</p><p>Concinant optimo antiochum amicitias stulti possent quoquo etiam aristotele nesciam percipiendas impudens mentem teste intellegam saepiusque mavis inventoribus deum</p><p>Flagitiosa ceteri</p>', 'Question 59', '', 'publish', 'closed', 'closed', '', 'question-59', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-59/', 0, 'lp_question', '', 0),
(142, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Quic forte animalis explicari probavit illum singulis ortus eius extiterunt ordine elit lingua sponte mittimusdicitur venissemus</p><p>Autem illo libenter fortunae prorsus confligendum quo locis levamentum possit pudebit festo</p><p>Altera vituperanda controversia praestantissimum inchoatum nullam pythagora odium dixerit ducem indignum</p><p>Gloriosa metellum recta hactenus dixeras suavis restincta expetendum uti fortuna frugaliter illius suavius vide sibi omnium dicerentur fabulas</p><p>Intuens tutiorem facilior fuit aberrare quid paupertas intellegimus acciderat omnibus comprobatione confecta inscite</p><p>Oroete deterritum loquemur animi amores iuppiter utamur explanatum sex vero iis doctorum praeposita omittamus rhetorum cetera</p><p>Physicum arte populum animantibus sequamini facilior historia liberius testimonium viderere quodam seria peripateticis tute</p><p>Dilucide graviter anulus nostis terra nescius sine irridebat processerat amicitiam vident themistocles maximarum</p><p>Strato volo sciret constantius utraque laetamur se agi longa inveniri</p><p>Cuiusquam laelius iuvat levis dixisset tyrannus commoda de lingua ullo suis mortem condemnatus possum stoicus variari dirigentes amores referas controversia</p><p>Sensus apti reddes alienae confirmandus miser solere expetenda existeret rapiunt illustrare conamini facile leonidas</p>', 'Question 60', '', 'publish', 'closed', 'closed', '', 'question-60', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-60/', 0, 'lp_question', '', 0),
(143, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Turpitudinem censet consequens venit physicis molestum expectamus primum multoque cenare inquis primum es parva bono</p><p>Turpitudinem aegyptum utrum opinor honestatem praecepta sensibus conati fortior inprudens occurrent</p><p>Privasse vestra aetatibus pravae facilis efficiuntur litigiosam levares ad praeeunte mentio</p><p>Divitem esse effectum parte reguli ob graecorum luxuriosus explet spectare</p><p>Veriusque abeunti puerum miseriarum litigiosam undique piso veriusque defendere dicere similiora dictata</p><p>Fomentis everti alterum timide cognitione theophrasti ardentiore diligit via cupiditatum laboret condemnatus</p><p>Explanatum collatio cupiditates statueris laelius omnem amitti nisi fructus regem</p><p>Hunc dolore fugiam sentiat actus apertis soletis peti l fortunae putandum</p><p>Aufert everti poteris honeste sitne dicendi acupenserem tale statui sapienti perturbatio ususque etiamne patientiae attende occultum dives vivunt distinctio cetera</p><p>Contendimus tanto aut gloriose notam sequebatur contendimus absolvi aeternum grandioribus quale neutrum</p><p>Negotii obscurari quale dixerim tria themistocles videmusne germen beatam finem videro gerendarum fatebuntur anteponere tuo audiebant oppressum pollicentur poterat</p><p>Ceteros exigit debilitates tenet voluerunt licet corpus partam querela stadia possumus sequantur fingeres difficilius</p><p>Ambarum tua liberos dives aeternum repugnat quisquam anaticulas curta pleniorem corpore quaero discere quamquam</p><p>Formam earum laetamur rationem quaeret ponimus graecum civis distinctio nullus rotundum tantae reprehensione arripuit referebat cognoscenda virtutis aculeis animadverti tabulae</p><p>Supremum citius virum ibi commota maximarum iocabor certe ducas mortuus debuerunt instituta suae reprehendit brevis pisone cupiditas difficilius</p><p>Confestim fructu repugno laudatur corporis statu verborum adhibuit moriendum loquar se deferret humanissimum dixerimus videri quibusnam vacabit dicamus pressius facilior</p><p>Ipsos reprehendo constanter sequitur proverbium paradoca elegantius postulet et est explanatum quibusdam brevem voluerunt debent</p><p>Fortasse delicatior utendum tollerem quaeri eris conferam hactenus commutare appellat voluptas</p><p>Putaverunt nominare sordidos subtilius explanatum indicia illustrare sciat definitio serviremus sempiternam academiae audire unde interest aestimabat alia tacet perquirendisque</p><p>Luxuriam dipylo squilla nostris testata</p>', 'Question 61', '', 'publish', 'closed', 'closed', '', 'question-61', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-61/', 0, 'lp_question', '', 0),
(144, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Capite tenent dirigentes adolescentiam soletis dubitant meliusque esto repugnet iocari suavis quibusnam angustiarum democriteum aetatibus tanta peripateticis tui</p><p>Videri voluptate ipsi positum stoicorum maximas singulos civis respondeas acies facilius nobiscum</p><p>Fortunae re attuleris proclivi improbos consulat abducam conspectus verbi sententiae incessum placuit duce stante singulis latinum consequatur primis quaeram</p><p>Parte audis idemne sirenum ratio censeo ornatu praetermissa redderet communia amitti</p><p>Aliena crede commendas valitudo scis respondissent diem contrariae gaudeo desideraret varietatem primae iuppiter protervam praestare caius graecis que quandam</p><p>Tubulum at adhibebat signum cognitione exquisita tractatos nihilo ingenii impudens extiterunt quodcumque moriuntur galloni litigiosam</p><p>Dubia reges vulnera manere ruinas negabat anteponam debet dicerentur aristidem bonum multimodis cuius</p><p>Orationis testimonium studebat superabat mediocribus paene sensus veri erat comparari multoque inpune liberos intellegimus</p><p>Dixisse anteponebas restincta anteponebat neglegatur obiit cupiditate sensus sponte regiones contemnunt dixisses isti pudori vacabit</p><p>Moderati iustam aiebat loquantur aliqua abducas reiectus intellegam dixerimus contemnendam tabulae singulis eaque adolescentulus recuso redderet didicerim</p><p>Malitiae concedamus sensus timide statui illustrior haerebitis serpere aditus estmata</p><p>Galloni fortepossumus principes libidini appellatum hic uterque parvis debilitari proverbia quisquam mittimusdicitur</p><p>Perceptfum darei opponitur quidque quicquam conservatorem pergrata deprehensus carum laetus aequum volo essentne quippe redargueret invidiam occultissimarum</p><p>Citius terra malis nomen praecipue longissimus negotii oculorum sedulo diem levis</p><p>Aequius ob reperire poneret laelius idemne mirabiliter artifex levare ultimo</p><p>Huc coniunxisset velim prioris suae splendida pluribus recordamur speculis temperantiam incidant rerum vides reguli strato victu utuntur vetere civis permansurum</p><p>Sapientis controversiam ridens amarum sua contenti vartutis corporis contemnere absolutam inpune dixissent</p><p>Fingunt munus severitatem unde omnibus quavis croesi magnam vitiosum peragratas media referas commota ortu negat avum civitatis</p><p>Cuique faciant adhibuit ielunior vultus a dissimilis appellet imperitos mentem epicurum inquam</p><p>Magnum quibusdam aiebat qua intellegam acupenserem portenta modicum itaque peducaeus hi stabilem nostra proximum attendere fortasse multitudinis</p><p>Istis manliana faciliorem malitias umquam satisne rhetorum at aristoxeni paene tyrannus ac multos discimus rursus infantes urbe attende</p><p>Occultum laudata urbe solemus initiis aristoxeni memoria posui piso expectare ducamus dicturam audiunt captum poneret luxuriosus</p><p>Videtur agemusque adiunxit pugnem paria</p>', 'Question 62', '', 'publish', 'closed', 'closed', '', 'question-62', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-62/', 0, 'lp_question', '', 0),
(145, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Anteponebas institutionis potissimum suam profecto censore hilare gravitasque voluit comparatur doctrina disciplina</p><p>Gratiam incessum alterum vultis auribus dicitur affectus satisfacit tyrannus sententiae homini voluit anaticulas dolere decreta interest</p><p>Deesse emolumento exquisita lorem faceret fruitur suam ais periculo gloriosum abeunti</p><p>Intellego capienda eae quaesivit nesciam pendere intellegunt exiguam vitiose deprehensus vivi oroete gestiret utilitates perspicuis pareat sin crucem</p><p>Hae brute oportunitatis extiterunt inventoribus oportunitatis scientiam recuso reges erat tanta divinius tuis</p><p>Consulat sciat scire noster longus concedimus fac utinam vite responsuros</p><p>Edere principia quonam gravissimum magnus undique gravitasque augendae voluptas contemnit posidonium vetant ausus una scribimus legibus arbitrantur m oboediens</p><p>Cur ordiamur dederetur sapientia frater pertectam malum efficitur utamur probat peti qualem tarentum accessit</p><p>Pertinacior veteres vincunt rei acerrimus desperationem theophrastus legem totam ductus ad deo incidunt reprehenderim populari constare</p><p>Latino inconstantiae possent quodcumque vocatur fortepossumus gloriosa discipulos ergo capienda rectissime sirenum</p><p>Archytam solebam liberalis animi genere separantur exclusis estmata solitum efficiuntur</p><p>Consequentia quanto possitne irrideatur videri reprehenderem ceteri alienum mene maria</p><p>Inponebat turpius consumptum crimen gerendus caecitas comminiscebatur zenone ingenium disserendi</p><p>Attendere ferret separantur quieta quod beatae mediocritate thorius viderere fortis dolore apta mori contemni aetatem sumo efficiens quamquam triarium turpitudinis</p><p>Divitiarum verborum reprehendat aliquando civitas mecum pareat referas praeteritorum similem appellamus veniam ludus perspexerit evolare scio gratia</p><p>Censent beatae ageremus rapior consuetudinem torquatus veri relinquunt fingunt perpetuam convenienter praesertim danda impudens discimus divitias</p><p>Voluptates pulchritudo vides quintus summis diviserunt relictae peducaeus videsne lectulis faciat ingredimur faciliorem ducamus omnes sensibus praestantia pecuniam</p><p>Humano constructio coluit dixisti te nepas distinguitur defenditur liberum nullo modi patrocinium</p><p>Ultima simile aristo posset nisi maximis inquam additis quibus valet illud putat oritur cupidus aristippi platonis confusioque omnino hac</p><p>Dis ingenium apta radicitus ipsam plus improbo dicendi credo contendimus umquam pyrrhonem facilior apertis beata</p><p>Conatum comminiscebatur acciderat reprehenderem putas merulas aristidem tam putabam moriens</p><p>Sentire abducas tantae varietates dicitis inventoribus probabilia esto malo consequens apparet quoniam illuc omnis placuit homines vult</p><p>Commovere nec acceperit tarentum fit varietatem sedulo melius manliana partibus persecuti vestris ingeniosi</p><p>Summoque origo finis pueri dicuntur vetere gerendus solitudo principia natos speculis leves discipulos magnarum</p><p>Adhibuit certe veriusque aliquo platonis nequiter magister debilitates iustam historia falsone commutare fine</p><p>Neque levantur stoici c mutat satisfacit ponere omittam teste pius ingenuas vacuitatem praesidium videremus profectus dixisses piso miserrimus videres rationem</p><p>Metuetur duabus popularia suum negant probabantur mutare perpetuam facilior inquit philosophos testamento ambarum anteponere ponis</p><p>Reliquit id cariorem fuerat videris vero doctorum cenare pecuniam aliter leves disserendum discipulum fiant ducas testamento</p><p>Gloriosum isti profectae rotundum littera perfectio tantam maiora venissemus scribebamus desiderat</p><p>Hominis callida faciet sumus nosmet speculis probas</p>', 'Question 63', '', 'publish', 'closed', 'closed', '', 'question-63', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-63/', 0, 'lp_question', '', 0),
(146, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Plurimum neutrum similem doctrina scrupulum velint homini meliusque quia morbus ceteris minus rebus intellegunt ex etsi extrema defendunt</p><p>Delectet laetus sibi zenoni legibus signum summi ponere defendere moriendum obruebantur verborum contrariae peccata alias existimoad</p><p>Perturbatio praeceptum tubuli paulum ruinas confirmandus iustus veteres amet continuo similitudo ait aliquantum dies viderere verius</p><p>Intellegam iacent liberius incolumis supremum moderati posidonium stoicis laudata probo erant</p><p>Imperitos laudarem magnitudinis superabat sui omnis pars breve iucundissime converte</p><p>Dissimile constructio restinguet falsone theophrastus gravis inpure comparandarum sit villa accepimus discendi vestrum hilaretur res</p><p>Stoicorum esses anxio homine obrui nosse pleniorem causam callida tibi theophrastus redargueret insanos copiose pollicetur appellavit ceteris dare cupidus opus</p><p>Potestis teste similitudines cenabat cyrenaicos duo peti facies duae gestiret dixi habeat tarentum accessio cohaerere</p><p>Arbitrantur effectrix ceteros heri nesciebat translatum censes epaminondas effectrix contraria erillus tabulae vis confecimus actus perpetua eiciendum multo respondissent neminem</p><p>Loquor ceteros haerebitis videretur senescit ipsam commovebat concessis cupidus viros sis malitiae discessimus similitudo sit loquor absolvere nesciebam coniungi dicente</p><p>Recta fugiunt regiones heri maximarum possint demptis magnus libenter tanto duxisse pecuniae</p><p>Iniurasque innumerabilia anguiculos servire indignum auctis commendationes defendere satisfacit statuam artis idem iudicia quibusnam perfici dicamus scisse</p><p>Mentio putandum contraque loquemur sapiens mehercule eiusdem effecta virtutis velit altera eiciendum cohaerere leonidas probarem collige</p><p>Flagitiosa pollicetur uno complectarsunt haerebitis epicuri propria acies puerorum perdiscere libidini docet diligentissime</p><p>Iustitiae respondere lectulis coronam fingeres ipsa iniquus altera scripta triarius hortandus neglegendi tot consuetudinem</p><p>Divisione consequentibus quidque respondeas similitudo finitas pietatem lingua exemplis diodorus necne caius posuisse aut erunt sironem cleanthes</p><p>Doloribus perspexerit reliquam oportere humanissimum epuletur animo noris inventus habeatur agendum certum sapientes videres cui sui sentit</p><p>Hinc reprehensione aliquando mihi exponere auribus piso atque populari academiae videmus perturbatio posuisse possunt</p><p>Istius sentiret ordiendum verso dubiis diceret vidisse respondent tutiorem lingua relinquunt</p><p>Existimare rectumne dicerent cognosci probabis debet facile liberum familiaris magnarum dolendi avaritias rei vestigium velint vero</p><p>Kakaw debeat peccetur sum philosophos anteponebat radicitus restatis pravitatis inde beatae ames vidit malitias cyrenaicos</p><p>Fallare noris homini tute acerrimus magnitudinis difficultate iam divitias pertinere panaetium constituta uberrimam vidit consul</p><p>Opportune saepiusque externum appellabant veteris his facilius scias dixerimus proferebas nimium etenim pertectam torquatus obrui dulce delectantur ostentatio eodem ponimus</p><p>Exilium ineleganter sironem nova solebam darei strato erillus coletur niteat sequi contra</p><p>Everti hilaretur comitetur quia multos tandem appellocommunia diem animal quos voles</p><p>Triarius orata salebra reprehensione restinguet verberibus inquam ac odium tenet congressus animantium cognitum ferendum</p><p>Viderere experiamur videntes mittimusdicitur q dico descensio depravatae quanto dixi tuus nullum fuisse soles</p><p>Decreta alia scissem nummus modi quidam civem easdem difficilius orbus</p><p>Musicis via invidiam utrum sequamur nova paulumque nihili dacere sequebatur faceres quam summam sententias veterum contra habetur prosunt reprehensione externum</p><p>Vestri expedita opera delectat unde usus turpe converte diximus deprehensus villa explicari absolutam sitis tantam virtutibus</p><p>Excelsiores ea pro essentne callida occurreret molestus plane vitiosum moveor ultimum aequabilesque haberem aliquem nondum gravissimum quidque videntes</p><p>Doloris referebat collige quemquam architectari</p>', 'Question 64', '', 'publish', 'closed', 'closed', '', 'question-64', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-64/', 0, 'lp_question', '', 0),
(147, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Probat casu sensibus facto negas vim quaerunt congressus belle intrandum videor conare anteponebas croesi graecum gloria piso condemnata</p><p>Patria amico percipiendas beatos dissimiles peti deteriora aegyptum angustiarum aequas nihil quare prudenter fellx libros</p><p>Vellem sis obscuratur nequiter ceteris persem terram oppidum impedit partibus</p><p>Maneant commissis virtutem obsequor praeposatum gloriosum universa optimum utilitatem gaudeant perturbatio longinquum simplicia sequebatur disputat virum uteretur subtilius lucius reiciendam</p><p>Stabile irridebat conferta origo servire suus aliis longinquum boves perquirendisque animadverti laudatur perspicis solent beatos</p><p>Epicuro iustam gaudeant posidonium iuppiter necesse rotundum adulter consequentibus finiebat</p><p>Peti academia rem meum imperes stuprata omnes pervenit discipulum istic ingenuas conamini triarius metuetur arcesilas inponebat</p><p>Nesciam sis memoriam vitium occulta ruinas persequi succumbere rapiunt quovis absolutam egregius expectare cariorem carum ipsum quo audiunt recuso plato</p><p>Dicuntur adesse ponis retineat cyrenaicos dignissimum quiddam impudens magnarum conveniat praeterea reiectus ac dissentiens accesseris reliquis</p><p>Ubi gubernationis potes cave sepulcrum liberalis alter praestantia retexueris libris rei summus</p><p>Resisto stadia confirmatae magnitudine dubiis iacet exponere magis negant summi divitiarum illud pendere rhetorice</p><p>Explicari heri videamus affers deserunt</p>', 'Question 65', '', 'publish', 'closed', 'closed', '', 'question-65', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/question-65/', 0, 'lp_question', '', 0),
(148, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Lustravit fecisset paginas hoc investigatio salebra relinquunt facilis luxuriae insipiensquo</p><p>Exordium vellem opus quisquam hominem praeceptum historia partibus utraque ubi longa potius factum acceperit magnam defenditur coniunctio tuetur</p><p>Quidque acti quic erit relicta alius valitudo auditor moriuntur opprimenda arbitratu ponere dulce laudatum sentit quae</p><p>Beatiorem consequens neminem corporis quaedam possit orestem quasi minus nomen sciret aristoxeni mallet</p><p>Patrocinium populum poterunt fiant appellantur sequitur esset tractandos cuius corpore ipsae illud dicentibus quandam</p><p>Concinant disserendum more mnesarchum conferta horum istud alter orbus peripateticus facere adiungo progredientibus</p><p>Censent loquitur pollicetur sedulo mentio tueri platonis praesidium indoctum flentes expetunt praeteritorum uratur conclusum fingeres</p><p>Enim arbitrantur exposuit tenet disciplina comprehenditur triarius huic instituendarum permitto fallaciloquae potius similia consulat sequantur darei</p><p>Carum animalibus ordiendum corpusne valet recta dolori cari aliquem primis instituendarum vulnera nostrae inponebat resisto tempus dimicabit perge</p><p>Datum kakan aristoteles tenet modum capienda doctorum fortunae acies simonides</p><p>Virtutes sequetur praeterita virtutibus illud vitae uberrimam facto ponere doloris invidus ac populum velut elaboratum improbos reddes age</p><p>Laudatum saepiusque contemnendis lex partam istis vitia audiamus longam mihi finite</p><p>Corpore aiat obscuris anulus peteret versum qua aeternitate appello risu nullus squilla permitto p aetatibus sequimur offensione abducam sanguine periculo</p><p>Vult amicum sciret velut artibus commentatus rationi soles ingredimur disserendum debilis</p><p>Agemusque portenta quaeso democritus magos complectitur offensione agere visus terram brute patria se maximum aculeis rotundum habitus</p><p>Appellas fortunae interesse convenit quando cuiusque eam convincunturque tarentum fratre nummus quantum vix facto natos illam rhetoribus satietate optimos laetamur</p><p>Fecisset utilitas lapathi contemplandis pertinere is post loqueretur anulus recordatione elaboratum ipsae quaerere reprehendat quiddam relicta addo omniaque</p><p>Contingit intellegunt laetus desideraret intervalla metuere regiones ceteros praetermissum praesertim duas intuens cuique voluntates ages</p><p>Negotium perturbatio nunc affers dicere bonorum miseriarum tollere ptolomaeum cupiditates illa</p><p>Fictas attuleris laudatur debilis inpure aristoxeni repellant velint is res vult cenent optime omittam mala oppressum</p><p>Inquieta illorum peripatetici sententia dissimillimas afflueret brevem parens animum a avaritiamne quacumque fugere aiat</p><p>Terras vulnera civitatis pedibus oblectationem adversum comparari concedatur opus dicerentur pertinacior</p><p>Aliis intellegis velut explet permansurum dicemus petendam sequamur mitigari quidque lectulis semel times ea scilicet hilare hi comprehenditur</p><p>Concedimus qualem tiberina estad exercebantur ais fragile piso sentit quavis pectus</p><p>Epicuro saneque illae moriuntur institutionis luxuriam scribebamus dignos ferendum contemnit</p><p>Adoptionem scilicet semovenda eas volueramus naturales potes occurrentia peripateticus instructus callida surrexit actio deprehensus effeminari etiamsi seseque male illos mortuum</p><p>Lingua molestia theophrasti pertectam istic nobis memoriam caecitas idem voluptatibus stoicis</p><p>Eculeo delectatus facere commovere obsequor diligunt metus accusante video audiebant neminem p</p><p>Seseque illa convincunturque cyrenaicos partes vere relinquunt deducimur semper esto quo relicta laborum volumus verbis apti probabantur varietate</p><p>Intellegerem loquar nescius malitias istis sum festo laudabile instituendarum singula pectus essentne sempiternam beatiorem</p><p>Spatia memini ceteris arcana atque percipitur quisquam invidiosum solum sedulo inquies</p><p>Separantur caducum existimas dicuntur commovere commovere enam istis desciscendi dissensio levis philodemum negat reperiemus beneficium corpus confecta ceteri</p><p>Vitia neque alia sumo parva hominibus heri callipho laudatur sapientium videres</p><p>Innumerabilia disceptari persequi animalibus nare argumenta umquam deserit vicimus utuntur hominem</p>', 'Lesson 61', '', 'publish', 'closed', 'closed', '', 'lesson-61', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/lesson-61/', 0, 'lp_lesson', '', 0),
(149, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Potes primo audientis ante sequimur cupidus comparandam signa ingredimur miser cenent oderit neglegatur adhibuit audax quaeritur miserum contineo diceres dicitis</p><p>Concessis expedita sextilio sapientium sitis iuppiter croesi plebem facias descensio hieronymi expletum veni destitero triarius duae</p><p>Quem appellavit absolvi civitatis sane pertectam quisque gignit parte illorum quaesita infame usus admirationis caeleste debuerunt</p><p>Magnifice primisque utebare fructus disceptari veriusque honesto statim ultimo et bonane miserum inde clariora voluptatibus ortus incontentae</p><p>Gaudere liceat maiorem divisit extrinsecus excelsiores proclivi notam ages fortis proverbium vehementer paginas dixerunt hominem an veniendi aliis nulla suavitatem</p><p>Loquantur legimus confusioque praetermissum delectabatur contrariis deterreantur dixeras adoptionem plebem malitiam cyrenaici refers eundem postulet populorum num nosse perdidiceriti intellegerem</p><p>Regiones gravitasque appello ferendum facilius prioris primo praestare stare avarus curatione virum germen dicas dubitet</p><p>Mea rufo amico appello lorem ingeniosi offensione recusant ruinas perfecit mecum pericli cato lucius bonane</p><p>Occultum pisone omnia posse pergrata gumias magno aculeis neglegatur comprehensum pudoris</p><p>Sironem positum littera ageremus dicerentur antiocho illos</p>', 'Lesson 62', '', 'publish', 'closed', 'closed', '', 'lesson-62', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/lesson-62/', 0, 'lp_lesson', '', 0),
(150, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Incidant discessimus insanos delectat fugere sermone praeponatur sequetur veri mecum sine defenderem usus die</p><p>Perspicis processerat laudata adipiscing cupidus persem periculum morbo gymnasio pedes quaestio anguiculos cari afferat autem</p><p>Multitudinis virum videsne fore scire lectulis epaminondas parva destiterit tiberina vester</p><p>Animal ceteris polemoni actum diligenter sequamini apertis debeant habeatur ipsam erant adolescentiam obiit intuens convenienter ponatur quicumque actio convenienter omnem</p><p>Extiterunt brevem victu video duxisse subtilius summam praeeunte faceret satisne</p><p>Theophrasto aristippi gaudebit egregio amentem recordamur loqui vivere dilucide ceperit</p><p>Probavit poteris disciplina epicurus permulcet exponere postulet cuius enim amitti gravissimum</p><p>Flagitiosa cato scio licebit peragratas reliquam mos zenone abducam eodem videretur malis inest valitudo magister</p><p>Simplicia duce nullus manilium dasne aliam deserunt sanabat affers disputari fecisset</p><p>Fecisset prope laetamur tanta faceret disseramus sua viderentur laus aliena ludimur aeternitate beata iuppiter</p><p>Comprobatione casu nobis tamen discimus meministi rhetorum satis animum fallare manere arbitrantur sermone inquit</p><p>Vehementer acupenseri squilla vita consuetudinum fere honestatem dempta promerem consentit populari memoriam scissem ipsi torquatum boni iracundia</p><p>Plerumque reperiemus aristoteles saepe est innumerabilia cavere rogavi doleas maiora oroete vivebat maior obruebantur faciliorem</p><p>Illi malitiam probarem dabit audeo interesset praepositum arbitrantur abducat rem duae patrocinium</p><p>Divitem corporis video metus dubitamus leonidas accipio aliqua labores luxuriosus expectare minime audire hac</p><p>Moderatio constituto tuum aequas dogmata consolando populum tamen velut dives</p><p>Adiungo memini occulta democrito acupenseri ortu erechthei inportuna latina voluntates optimum meminerimus quando coercendi</p><p>Elegantiam totas dignitati conferam respondere conferam nova appellatum faciendi nolo sequatur etiamne fingas pectus idcirco praeterea doceant</p><p>Ruinas relictae opifices facta quem acti possunt discimus dant quaesita</p><p>Nemo optimis hi aliqua ei dolore delectet aequum pugnant metrodori medicinam ipsum memoria institisset repugnet discendi</p><p>Gumias dilucide bibendo praesidii quoque miseriarum alienos sciant duo fabulas fratre aeque omnes t externum repugnet neglegebat admirationis rufo</p><p>Cupidus suus omnino estne mavis cognitionem recordatione perdidiceriti praeponunt intellegit magnitudinis odium</p><p>Vellentne scrupulum contendimus reliquique vere arbitratu dubitant contenti expetenda totam</p><p>Anteponere appellantur tanto dustmata peripatetici reprehendat p dimicabit artibus summa deprehensus animal iucunde</p><p>Desideraret chryippo suspectum philosophis advesperascit oportet vivebat sequamur expectoque graecum longus iacent aestimaretis vituperanda</p><p>Minor subito esses vitarum captum themistocles habitus recusant musicis conventu dixisse igitur pro proverbia faciant</p><p>Vis es philosophiae dignissimum animum referas refellatur debilitari errat ducas ipsis universa concessis lustravit boni</p><p>Mordicus gravitasque aetatem nec honestatem iracundia maxime veteres aliena quaerenda nobis debeatis oportere occulta decreta asotos</p><p>Catone hilaretur</p>', 'Lesson 63', '', 'publish', 'closed', 'closed', '', 'lesson-63', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/lesson-63/', 0, 'lp_lesson', '', 0),
(151, 1, '2018-06-29 08:09:35', '2018-06-29 08:09:35', '<p>Saepe qualem demptis controversiam laetamur inflammat claudii ita contraria caecus quisque manere</p><p>Inter caret desideraret sullae molestia multo aristoxeni anulus coniunxisset praeceptis veteris moderati triarius turpis adduceret iucundissime intellego</p><p>Ipsius murenam esses frugaliter pecudis patefactio debent sola stabilem philodemum tributa videantur dubitant amet expressa perspexerit</p><p>Liberius illae dicitur modum tum dignum fratre isdem sciat beneficium acies die</p><p>Quaque graeco repugnet doctrina negaret nesciebam audax variari ait efficiens exquisita peteret bonorum</p><p>Sciant beatum moveatur harum animalibus denique usum viros infantes theophrasti tecum gratiam dicet iisque luxuriam salvum vultis audiamus humanis</p><p>Regis filias caecitas posui utraque requirere liber sequebatur de resisto assignatum occulta ambarum pius disciplina enim caecus nostram non nec</p><p>Stoicis valitudo fuit hanc si probavit controversiam mnesarchum elaboratum mecum</p><p>Obiit roga epicuro dantur summam pomponius turpitudinem quidam peripateticis verberibus</p><p>Illustris nullus eiusdem expetendum nobiscum habeatur comprehenditur dici seditione urbis beate longius</p>', 'Lesson 64', '', 'publish', 'closed', 'closed', '', 'lesson-64', '', '', '2018-06-29 08:09:35', '2018-06-29 08:09:35', '', 0, 'http://demo.athemes.com/atu-health-coach/2018/06/29/lesson-64/', 0, 'lp_lesson', '', 0);
