(413, 1, '2018-06-29 07:36:23', '2018-06-29 07:36:23', '<h2>AFTERPAY<br>\nSALE NOW ON</h2>		\n			<a href=\"#\" role=\"button\">\n						Grab a bundle and save more!\n					</a>\n			<a href=\"#\" role=\"button\">\n						New Client Packages\n					</a>\n			<a href=\"#\" role=\"button\">\n						Book an appointment\n					</a>\n			<h2>OUR SIGNATURE HAIR PACKAGES</h2>		\n				<figure><img src=\"http://localhost/wordpress/wp-content/uploads/2020/03/Refine-Toner-Package-Pic-360x360.jpg\" alt=\"Refine Toner Package Pic\" /><figcaption>Refine Toner Package Pic</figcaption></figure><figure><img src=\"http://localhost/wordpress/wp-content/uploads/2020/03/Oll-Over-Colour-360x360.jpg\" alt=\"Oll-Over-Colour\" /><figcaption>Oll-Over-Colour</figcaption></figure><figure><img src=\"http://localhost/wordpress/wp-content/uploads/2020/03/full-head-foils-package-2-360x360.jpg\" alt=\"full-head-foils-package-2\" /><figcaption>full-head-foils-package-2</figcaption></figure><figure><img src=\"http://localhost/wordpress/wp-content/uploads/2020/03/Creative-Colour-Package-360x360.jpg\" alt=\"Creative-Colour-Package\" /><figcaption>Creative-Colour-Package</figcaption></figure><figure><img src=\"http://localhost/wordpress/wp-content/uploads/2020/03/Blonde-Ambition-Package-360x360.jpg\" alt=\"Blonde Ambition Package\" /><figcaption>Blonde Ambition Package</figcaption></figure><figure><img src=\"http://localhost/wordpress/wp-content/uploads/2020/03/7897969574nc-full-head-package-pic-360x360.jpg\" alt=\"7897969574nc-full-head-package-pic\" /><figcaption>7897969574nc-full-head-package-pic</figcaption></figure><figure><img src=\"http://localhost/wordpress/wp-content/uploads/2020/03/680219890-360x360.jpg\" alt=\"680219890\" /><figcaption>680219890</figcaption></figure><figure><img src=\"http://localhost/wordpress/wp-content/uploads/2020/03/68154716d-360x360.jpg\" alt=\"68154716d\" /><figcaption>68154716d</figcaption></figure><figure><img src=\"http://localhost/wordpress/wp-content/uploads/2020/03/67936232