(471, 1, '2020-03-18 13:15:00', '2020-03-18 13:15:00', '/* Testimonials */\n.atu-hc-testimonial .elementor-testimonial-content {\n	padding: 30px;\n	background-color: #f7f7f7;\n}\n.atu-hc-testimonial .elementor-testimonial-meta-inner {\n	margin-left: 20px;\n}\n.atu-hc-testimonial .elementor-testimonial-image {\n	position: relative\n}\n.atu-hc-testimonial .elementor-testimonial-image::after {\n	content: \'\';\n	position: absolute;\n	top: -21px;\n	left: 20px;\n  width: 0; \n  height: 0; \n  border-left: 10px solid transparent;\n  border-right: 10px solid transparent;\n  border-top: 10px solid #f7f7f7;\n}\n\n/* Contact form */\n.atu-hc-contact input:not(.wpcf7-submit) {\n	width: 100%;\n	padding-top: 11px;\n	padding-bottom: 11px;\n}\n.atu-hc-contact .contact-row {\n	margin-bottom: 10px;\n}\n.atu-hc-contact .col-md-6:first-of-type {\n	padding-right: 5px;\n}\n.atu-hc-contact .col-md-6:last-of-type {\n	padding-left: 5px;\n}\n.atu-hc-form {\n	max-width: 470px;\n}\n\n/* Contact page map */\n.contact-page-map #atu-map {\n	height: 400px;\n}\n.contact-page-form label,\n.contact-page-form input:not(.wpcf7-submit),\n.contact-page-form select {\n	width: 100%;\n	max-width: 100%;\n}\n.contact-page-form select {\n	padding: 17px 20px;\n}\n.contact-page-form .wpcf7-submit {\n	width: auto;\n	margin: 0 auto;\n	display: table;\n	border-radius: 30px;\n	box-shadow: 0 5px 35px 0 rgba(51, 51, 51, 0.26);\n}\n.contact-page-form .row {\n	margin-bottom: 10px;\n}\n.menuStyle2 .main-navigation .header-search-toggle a:hover:after {\n	display: none;\n}\n.back_line{\n	    text-align: center;\n    background-position: center center;\n    font-size: 19px;\n    margin: 0 15px 40px 15px;\n}', 'airi', '', 'inherit', 'closed', 'closed', '', '204-revision-v1', '', '', '2020-03-18 13:15:00', '2020-03-18 13:15:00', '', 204, 'http://localhost/wordpress/index.php/2020/03/18/204-revision-v1/', 0, 'revision', '', 0),
