(521, 1, '2020-03-19 11:53:13', '2020-03-19 11:53:13', '<h2>AFTERPAY<br>\nSALE NOW ON</h2>		\n			<a href=\"#\" role=\"button\">\n						Grab a bundle and save more!\n					</a>\n			<a href=\"#\" role=\"button\">\n						New Client Packages\n					</a>\n			<a href=\"#\" role=\"button\">\n						Book an appointment\n					</a>\n			<h2>OUR SIGNATURE HAIR PACKAGES</h2>		\n			<a href=\"#\" role=\"button\">\n						View all packages\n					</a>\n			<h2>WHAT\'S HAPPENING AT VIVO!</h2>		\n			<figure><img src=\"http://localhost/wordpress/wp-content/uploads/elementor/thumbs/web-post-everyday-omsb7u7jxgd5vu1dewu95qxe5qo8voyv1939t0xz8w.jpg\" title=\"web-post-everyday\" alt=\"web-post-everyday\" /></figure><h4>Now Every Day is a Sale Day!</h4><p>Vivo Hair Salon & Skin Clinic brings you your very own Online Shopping Code to get the best deals every day!...\n</p>		\n			<figure><img width=\"554\" height=\"380\" src=\"http://localhost/wordpress/wp-content/uploads/2020/03/Nigel-Ruissel-Curly-Girls.jpg\" alt=\"\" srcset=\"http://localhost/wordpress/wp-content/uploads/2020/03/Nigel-Ruissel-Curly-Girls.jpg 554w, http://localhost/wordpress/wp-content/uploads/2020/03/Nigel-Ruissel-Curly-Girls-300x206.jpg 300w\" sizes=\"(max-width: 554px) 100vw, 554px\" /></figure><h4>Calling all Curly Girls!</h4><p>Vivo is excited to announce that joining us as a National Educator in curly haircutting, and as a Senior Stylist in Vivo Mairangi Bay, is curly-haired specialist Nigel Russell. ...</p>		\n			<figure><img src=\"http://localhost/wordpress/wp-content/uploads/elementor/thumbs/32887web-post-leapdaysale-omsbqqqpdi8rdikv1305az748phzok0iytet9cwy40.jpg\" title=\"32887web-post-leapdaysale\" alt=\"32887web-post-leapdaysale\" /></figure><h4>Vivo Poets\' Corner Leap Day Sale (Exclusive in-salon 1 day only Sale)</h4><p>Hop on over this weekend to Vivo Poets\' Corner massive Leap Year Sale! It only comes around once every 4 years, so we are making the day un-frog-getable! Limited stock available - only on Saturday, 2